"138122":{"id":"138122","name":"O Melhor Aluno","slug":"o-melhor-aluno","original_title":"Student of the Year","overview":"Esses dois ex-rivais se tornaram amigos. Mas tudo muda quando o prêmio de Estudante do Ano e uma bolsa de estudos em uma faculdade de prestígio estão em jogo.","first_air_date":"2012-10-19","runtime":145,"episode_run_time":[145],"vote_average":5.7,"created_by":["Dharma Productions","Red Chillies Entertainment"],"production_companies":[{"name":"Dharma Productions"},{"name":"Red Chillies Entertainment"}],"cast":["Sidharth Malhotra","Varun Dhawan","Alia Bhatt","Rishi Kapoor","Sana Saeed"],"backdrop_path":"https://image.tmdb.org/t/p/original/91a2VC6YSEawfxPEIqsmJOfah89.jpg","poster_path":"https://image.tmdb.org/t/p/original/yAhfRGZx7nOAZkrm90pqaAjakdH.jpg","certification":"N/A","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
"802372":{"id":"802372","name":"Os Odiados do Casamento","slug":"os-odiados-do-casamento","original_title":"The People We Hate at the Wedding","overview":"As tensões familiares aumentam entre os irmãos Alice e Paul, que, mesmo contrariados, concordam em ir ao casamento de sua distante meia-irmã rica no interior da Inglaterra com sua mãe, Donna. Ao longo da semana do casamento, muitos esqueletos do passado são arrancados do armário, e a improvável reunião dá a todos a motivação para seguir em frente com suas próprias vidas. Essa é uma comédia de casamento moderna para qualquer pessoa com uma família um pouco disfuncional (todos), ou qualquer pessoa que foi forçada a comparecer a um casamento que tentou evitar (também todos).","first_air_date":"2022-11-17","runtime":99,"episode_run_time":[99],"vote_average":6.2,"created_by":["Amazon Studios","FilmNation Entertainment","Wishmore"],"production_companies":[{"name":"Amazon Studios"},{"name":"FilmNation Entertainment"},{"name":"Wishmore"}],"cast":["Kristen Bell","Ben Platt","Allison Janney","Cynthia Addai-Robinson","Dustin Milligan"],"backdrop_path":"https://image.tmdb.org/t/p/original/tkbiKQeizzkSFV2hvalcdc8e8Kn.jpg","poster_path":"https://image.tmdb.org/t/p/original/kQZKw9jetOInPPdSZgbKFxJALHc.jpg","certification":"14","genres":["Comédia"],"trailer":"AHtTfu2zJuk"},
"573560":{"id":"573560","name":"Máquina da Vingança","slug":"maquina-da-vinganca","original_title":"The Car: Road to Revenge","overview":"Em um futuro distópico, o promotor público Caddock é brutalmente assassinado por um grupo de criminosos. Ao ser arremessado de um prédio e morrer em cima do próprio carro, o espírito de Caddock reencarna no veículo e deseja vingança.","first_air_date":"2019-01-08","runtime":89,"episode_run_time":[89],"vote_average":6.4,"created_by":["BUFO","Universal 1440 Entertainment"],"production_companies":[{"name":"BUFO"},{"name":"Universal 1440 Entertainment"}],"cast":["Grant Bowler","Kathleen Munroe","Martin Hancock","Micah Balfour","Burt Grinstead"],"backdrop_path":"https://image.tmdb.org/t/p/original/eVjSkCEhxhIwHKiqhNiFF9iceAx.jpg","poster_path":"https://image.tmdb.org/t/p/original/fqhHSSndJwdk0Pzv7CFs5wHnqXV.jpg","certification":"16","genres":["Ação","Terror","Thriller","Ficção científica"],"trailer":"N/A"},
"29787":{"id":"29787","name":"Instinto Fatal","slug":"instinto-fatal","original_title":"Monkey Shines","overview":"Allan, uma rapaz cheio de vida com uma linda namorada, sofre um acidente e fica tetraplégico. Cansado de hipocrisia dos que o rodeiam, só tem como amigo, Geoffrey que lhe dá uma macaca de presente. Ela é um experimento de laboratório que parece ter um cérebro quimicamente humano, o que a faz ter um contato telepático com Allan, passando a destruir todos que o atormentam.","first_air_date":"1988-07-29","runtime":113,"episode_run_time":[113],"vote_average":6.3,"created_by":["Orion Pictures","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Orion Pictures"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Jason Beghe","John Pankow","Kate McNeil","Joyce Van Patten","Christine Forrest"],"backdrop_path":"https://image.tmdb.org/t/p/original/6yjyTfX3bupv91OAh9LGXWb718w.jpg","poster_path":"https://image.tmdb.org/t/p/original/z0NM4QuToVyKQl4blRntbcTGfas.jpg","certification":"N/A","genres":["Terror","Ficção científica","Drama","Thriller"],"trailer":"N/A"},
"14073":{"id":"14073","name":"Jodhaa Akbar","slug":"jodhaa-akbar","original_title":"जोधा अकबर","overview":"Jodhaa Akbar conta a história de uma aliança entre duas culturas e religiões, onde o Imperador muçulmano Jalaluddin Mohammad Akbar, casa-se com a jovem e destemida Jodhaa, filha do Rei hindu Bharmal de Amer. Um romance épico do século 16, que parte dos campos de batalha onde o jovem Jalaluddin, é coroado, passando pelas conquistas que lhe deram o título de Akbar, o Grande. Em seus esforços para fortalecer suas relações com os hindus, Akbar, aceita desposar a bela e desafiante Jodhaa, sem saber que vai por sua vez embarcar numa nova jornada – a jornada do amor verdadeiro.","first_air_date":"2008-02-13","runtime":213,"episode_run_time":[213],"vote_average":7.3,"created_by":["UTV Motion Pictures","Ashutosh Gowariker Productions"],"production_companies":[{"name":"UTV Motion Pictures"},{"name":"Ashutosh Gowariker Productions"}],"cast":["Hrithik Roshan","Aishwarya Rai Bachchan","Sonu Sood","Kulbhushan Kharbanda","Suhasini Mulay"],"backdrop_path":"https://image.tmdb.org/t/p/original/n19pClzY673UkZvECNZMDO2ViMP.jpg","poster_path":"https://image.tmdb.org/t/p/original/gPjgeywFNTlh9IUuXWy85nn4h8J.jpg","certification":"N/A","genres":["Romance","História","Drama"],"trailer":"N/A"},
