"40814":{"id":"40814","name":"Crimes de Paixão","slug":"crimes-de-paixao","original_title":"Crimes of Passion","overview":"Joanna é uma bem-sucedida estilista de modas durante o dia. À noite, sai às ruas de peruca loira e é conhecida no submundo como a prostituta China Blue. É à noite que ela realiza todas as suas fantasias. China é perseguida por um reverendo psicopata que deseja salvá-la do pecado. Bobby, frustrado no casamento com Amy, é quem irá descobrir o segredo de China Blue, interessando-se por ela.","first_air_date":"1984-10-19","runtime":107,"episode_run_time":[107],"vote_average":6.3,"created_by":["New World Pictures","China Blue Productions","Planet Productions"],"production_companies":[{"name":"New World Pictures"},{"name":"China Blue Productions"},{"name":"Planet Productions"}],"cast":["Kathleen Turner","Anthony Perkins","John Laughlin","Annie Potts","Bruce Davison"],"backdrop_path":"https://image.tmdb.org/t/p/original/zC23CmCRsNCQuL9ncqCa4wufIRu.jpg","poster_path":"https://image.tmdb.org/t/p/original/ztIQwhIT8ZU0YtbEUddtRb9QeGJ.jpg","certification":"N/A","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
"4710":{"id":"4710","name":"Masculino, Feminino","slug":"masculino-feminino","original_title":"Masculin féminin","overview":"Paul é jovem, acaba de sair do serviço militar francês e está desiludido com a vida. Enquanto sua namorada constrói uma carreira como cantora pop, Paul fica mais isolado de seus amigos e de sua vida social. O filme mostra também, de um modo singelo, a revolta dos jovens com a guerra do vietnã.","first_air_date":"1966-03-22","runtime":105,"episode_run_time":[105],"vote_average":7.2,"created_by":["SF Studios","Sandrews","Anouchka Films","Argos Films"],"production_companies":[{"name":"SF Studios"},{"name":"Sandrews"},{"name":"Anouchka Films"},{"name":"Argos Films"}],"cast":["Jean-Pierre Léaud","Chantal Goya","Marlène Jobert","Michel Debord","Catherine-Isabelle Duport"],"backdrop_path":"https://image.tmdb.org/t/p/original/83AMHdZU71x7U4aZ7QFGBRtdyxo.jpg","poster_path":"https://image.tmdb.org/t/p/original/6UvGV2nSh7fGYf4Ho1BGMKZlqRX.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
