"219":{"id":"219","name":"Volver","slug":"volver","original_title":"Volver","overview":"Na classe trabalhadora de Madri, Raimunda precisa lidar com a morte do marido enquanto luta para sustentar sua família. Mas rodeada por três gerações de mulheres — sua irmã Sole, sua filha Paula e sua amiga Augustina — e assombrada pela falecida mãe, Raimunda fará mais do que apenas sobreviver.","first_air_date":"2006-03-17","runtime":121,"episode_run_time":[121],"vote_average":7.5,"created_by":["El Deseo","Canal+ España","TVE","Focus Features","Sony Pictures Classics"],"production_companies":[{"name":"El Deseo"},{"name":"Canal+ España"},{"name":"TVE"},{"name":"Focus Features"},{"name":"Sony Pictures Classics"}],"cast":["Penélope Cruz","Carmen Maura","Lola Dueñas","Blanca Portillo","Yohana Cobo"],"backdrop_path":"https://image.tmdb.org/t/p/original/bwyE6Htr6BFZPaz1uLrZY5oKnm0.jpg","poster_path":"https://image.tmdb.org/t/p/original/kj1NDuSRjchGRARLDyKGiQUd76.jpg","certification":"14","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
"16072":{"id":"16072","name":"Deuses e Generais","slug":"deuses-e-generais","original_title":"Gods and Generals","overview":"Uma nação em guerra com sua própria essência. Três bravos homens, em três batalhas cruciais. Os homens: Joshua Chamberlain, \"Stonewall\" Jackson, Robert E. Lee. As batalhas: Manassas, Fredericksburg, Chancellorsville. Pelos olhos desses combatentes, testemunharemos a bravura e as diferenças de uma nação que, como uma mãe, assiste aos seus filhos guerrearem bem abaixo de seus seios. Baseado no bestseller de Jeffrey M. Shaara, Deuses e Generais retrata as intensas alianças e os grandiosos combates do começo da Guerra Civil norte-americana. Ronald F. Maxwell dirige o épico cujos acontecimentos antecedem cronologicamente os fatos relatados na obra Gettysburg, do mesmo autor.","first_air_date":"2003-02-21","runtime":219,"episode_run_time":[219],"vote_average":6.3,"created_by":["Turner Pictures","Antietam Filmworks","Esparza / Katz Productions","Neufeld/Rehme Productions","Mace Neufeld Productions","Warner Bros. Pictures"],"production_companies":[{"name":"Turner Pictures"},{"name":"Antietam Filmworks"},{"name":"Esparza / Katz Productions"},{"name":"Neufeld/Rehme Productions"},{"name":"Mace Neufeld Productions"},{"name":"Warner Bros. Pictures"}],"cast":["Stephen Lang","Jeff Daniels","Robert Duvall","Kevin Conway","C. Thomas Howell"],"backdrop_path":"https://image.tmdb.org/t/p/original/zIvABsW1PhqLfbMGRuPqd6th8Dx.jpg","poster_path":"https://image.tmdb.org/t/p/original/9F43DLMn2UgcBl79RKUzIlkMNGU.jpg","certification":"16","genres":["Drama","História","Guerra"],"trailer":"N/A"},
"11215":{"id":"11215","name":"Presente de Grego","slug":"presente-de-grego","original_title":"Baby Boom","overview":"Em Manhattan J.C. Wiatt (Diane Keaton), uma executiva de meia-idade que está prestes a atingir um dos postos mais altos da empresa na qual trabalha, tem sua vida profissional e pessoal totalmente alterada quando \"herda\" a guarda de Elizabeth, uma menina que é filha de um parente distante que morreu. Gradativamente J.C. se envolve com a criança e resolve assumir sua educação, mas acaba perdendo o emprego. Ela então se muda com a filha para o interior, disposta a recomeçar do zero e compra uma casa com diversos problemas. Aos poucos ela contorna as dificuldades e se envolve com Fritz Curtis (Sam Wanamaker), um veterinário da região. Mas o que J.C. não poderia imaginaré que indiretamente a criança seria responsável por um sucesso que ela nunca tinha alcançado.","first_air_date":"1987-10-07","runtime":110,"episode_run_time":[110],"vote_average":6.4,"created_by":["United Artists","The Meyers/Shyer Company","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"United Artists"},{"name":"The Meyers/Shyer Company"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Diane Keaton","Sam Shepard","Harold Ramis","Kristina Kennedy","Michelle Kennedy"],"backdrop_path":"https://image.tmdb.org/t/p/original/v0negFRxnxLtanMNXY7HYP7RUZ6.jpg","poster_path":"https://image.tmdb.org/t/p/original/7nMu0pR3U7qCZhrPDRUxPOZ50AK.jpg","certification":"N/A","genres":["Drama","Comédia","Romance"],"trailer":"N/A"},
"13341":{"id":"13341","name":"Sujou... Chegaram os Bears","slug":"sujou-chegaram-os-bears","original_title":"Bad News Bears","overview":"Morris Buttermaker é um ex-jogador de beisebol que decide treinar um time amador onde nenhum jogador tem talento suficiente para jogar o esporte até tornar a equipe campeã de uma liga amadora extremamente competitiva.","first_air_date":"2005-07-22","runtime":113,"episode_run_time":[113],"vote_average":5.8,"created_by":["Media Talent Group","Detour Filmproduction","Paramount Pictures"],"production_companies":[{"name":"Media Talent Group"},{"name":"Detour Filmproduction"},{"name":"Paramount Pictures"}],"cast":["Billy Bob Thornton","Greg Kinnear","Marcia Gay Harden","Sammi Kane Kraft","Ridge Canipe"],"backdrop_path":"https://image.tmdb.org/t/p/original/tpL6vrHgT3QVWdqUyWzoQCdZKAZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/phwdf3XCrt3C7gmwwR3g3WlJiNg.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"866678":{"id":"866678","name":"Furioza","slug":"furioza","original_title":"Furioza","overview":"Um acontecimento do passado separa o destino de três amigos. Inesperadamente, na vida de David (Mateusz Banasiuk) tal acontecimento reaparece. Dzika (Weronika Ksiazkiewicz) - uma vez o amor de sua vida, agora uma policial experiente, faz uma oferta que não pode ser rejeitada: Ou ele se torna um informante da polícia, ou seu irmão (Wojciech Zielinski) vai para a prisão com uma sentença pesada. Sentindo-se pressionado, David finalmente sucumbe, e seu principal objetivo passa a ser se infiltrar no crime organizado. Em plena guerra por influência e dinheiro, ele terá que enfrentar as constantes suspeitas de Golden (Mateusz Damiecki) e logo descobrirá que o mundo do qual tentou se libertar o atrai com ainda mais força.","first_air_date":"2021-10-22","runtime":139,"episode_run_time":[139],"vote_average":6.4,"created_by":["Hungry Crocodiles"],"production_companies":[{"name":"Hungry Crocodiles"}],"cast":["Mateusz Banasiuk","Weronika Książkiewicz","Mateusz Damięcki","Łukasz Simlat","Wojciech Zieliński"],"backdrop_path":"https://image.tmdb.org/t/p/original/4G7216ezKodauyP7cvNswiEf33k.jpg","poster_path":"https://image.tmdb.org/t/p/original/sSIo1vG0IILxzHkLKmtFEoTbVE9.jpg","certification":"18","genres":["Drama","Ação","Crime"],"trailer":"N/A"},
"31047":{"id":"31047","name":"Crimes no Paraíso: Travessia Noturna","slug":"crimes-no-paraiso-travessia-noturna","original_title":"Jesse Stone: Night Passage","overview":"Um detetive de Los Angeles assume o Departamento de Polícia de uma pequena cidade em Massachusetts. Enquanto tenta conquistar sua nova equipe, o policial investiga o caso de um homem envolvido com a máfia. Stone entrou de cara em um caso de lavagem de dinheiro envolvendo o gerente do banco e outras autoridades locais. Ir mais fundo seria mexer com gente poderosa, atrair ódio e vingança, talvez desistir de sua almejada tranquilidade. Valeria a pena?","first_air_date":"2006-01-15","runtime":89,"episode_run_time":[89],"vote_average":6.9,"created_by":["Sony Pictures Television","Brandman Productions","TWS Productions II"],"production_companies":[{"name":"Sony Pictures Television"},{"name":"Brandman Productions"},{"name":"TWS Productions II"}],"cast":["Tom Selleck","Saul Rubinek","Viola Davis","Kohl Sudduth","Stephen Baldwin"],"backdrop_path":"https://image.tmdb.org/t/p/original/b8tprVuRrB11sSk026D4dNktvov.jpg","poster_path":"https://image.tmdb.org/t/p/original/mHy5827IALqkLyv5htqiikxNjZL.jpg","certification":"16","genres":["Drama","Thriller","Cinema TV"],"trailer":"N/A"},
