"834027":{"id":"834027","name":"Val","slug":"val","original_title":"Val","overview":"Val Kilmer documentou sua vida e arte por meio do cinema. Ele acumulou milhares de horas de filmagem, desde filmes caseiros feitos com seus irmãos até papéis icônicos em filmes de sucesso como Top Gun e Batman. Este documentário original revela uma vida vivida aos extremos e um olhar cheio de coração sobre o que significa ser um artista.","first_air_date":"2021-07-23","runtime":109,"episode_run_time":[109],"vote_average":7.1,"created_by":["A24","Boardwalk Pictures","Cartel Films","IAC Films","ValArt Ltd","HelMel Studios","TwainMania"],"production_companies":[{"name":"A24"},{"name":"Boardwalk Pictures"},{"name":"Cartel Films"},{"name":"IAC Films"},{"name":"ValArt Ltd"},{"name":"HelMel Studios"},{"name":"TwainMania"}],"cast":["Val Kilmer","Jack Kilmer","Mercedes Kilmer","Joanne Whalley","Kevin Bacon"],"backdrop_path":"https://image.tmdb.org/t/p/original/8j1zuLhybziNeXhRUblazkvbUks.jpg","poster_path":"https://image.tmdb.org/t/p/original/vWJKmfmjpkFeTbUGep6t7w5TexA.jpg","certification":"16","genres":["Documentário"],"trailer":"N/A"},
"501":{"id":"501","name":"O Homem-Urso","slug":"o-homem-urso","original_title":"Grizzly Man","overview":"A vida e a morte de Timothy Treadwell, ecologista e especialista em ursos. Por 13 verões consecutivos Treadwell foi para o Alasca viver desarmado entre esses animais. Nas últimas 5 vezes ele documentou sua viagem com uma câmera. Em outubro de 2003 os restos mortais de Treadwell e de sua namorada Amie Huguenard foram encontrados pelo piloto que deveria trazê-los de volta. O casal fora devorado por um urso, o primeiro caso registrado de ataque naquele campo. Herzog utiliza as filmagens de Treadwell para explorar sua personalidade e levantar questões sobre a difícil relação entre homem e natureza.","first_air_date":"2005-07-28","runtime":100,"episode_run_time":[100],"vote_average":7.5,"created_by":["Discovery Docs","Real Big Production","Lions Gate Films"],"production_companies":[{"name":"Discovery Docs"},{"name":"Real Big Production"},{"name":"Lions Gate Films"}],"cast":["Timothy Treadwell","Warren Queeney","Willy Fulton","Sam Egli","Marnie Gaede"],"backdrop_path":"https://image.tmdb.org/t/p/original/CemU4TsKJv5tmVy1eLfs8oroEh.jpg","poster_path":"https://image.tmdb.org/t/p/original/zuZWpcuye25rpsiZ4XzsAvmLDHG.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
