"14976":{"id":"14976","name":"O Casamento de Rachel","slug":"o-casamento-de-rachel","original_title":"Rachel Getting Married","overview":"Kym é uma jovem bonita, inteligente e também problemática. Ex-modelo, em seus dez últimos anos de vida tem passado constantemente por tratamentos em clínicas de reabilitação. Em sua última internação, logo que sai da clínica ela vai direto para a casa de seu pai, onde a família a aguarda para o casamento de sua irmã Rachel. O longo histórico de crises pessoais e conflitos familiares acompanham Kym em sua participação no reencontro. Mas é na companhia de parentes e amigos queridos que a jovem percebe e aprende novas lições como amor, afeição, generosidade e espírito familiar.","first_air_date":"2008-09-03","runtime":113,"episode_run_time":[113],"vote_average":6.3,"created_by":["Clinica Estetico","Marc Platt Productions"],"production_companies":[{"name":"Clinica Estetico"},{"name":"Marc Platt Productions"}],"cast":["Anne Hathaway","Rosemarie DeWitt","Bill Irwin","Debra Winger","Tunde Adebimpe"],"backdrop_path":"https://image.tmdb.org/t/p/original/a7lZSjySyf2OLMj5VLkYTDS0kbr.jpg","poster_path":"https://image.tmdb.org/t/p/original/iOGy6Krf8iX73BesAWymuZcFXRn.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
