"14749":{"id":"14749","name":"Space Buddies: Uma Aventura no Espaço","slug":"space-buddies-uma-aventura-no-espaco","original_title":"Space Buddies","overview":"Os irresitíveis filhotes falantes da Disney estão de volta em um filme inédito que vai levá-los onde nenhum outro filhotes jamais esteve: na Lua! Para enfrentar essa aventura de outro mundo eles vão precisar de muita coragem. Space Buddies é um pequeno passo para os cães, e um gigantesco passo para os caninos, com diversão garantida para toda a família..","first_air_date":"2009-02-02","runtime":84,"episode_run_time":[84],"vote_average":5.9,"created_by":["Key Pix Productions","Keystone Entertainment"],"production_companies":[{"name":"Key Pix Productions"},{"name":"Keystone Entertainment"}],"cast":["Josh Flitter","Skyler Gisondo","Field Cate","Liliana Mumy","Henry Hodges"],"backdrop_path":"https://image.tmdb.org/t/p/original/uRid6IoOpSklL6HYwx8IIrWANnH.jpg","poster_path":"https://image.tmdb.org/t/p/original/5gIDqST1ikTlAHU4aDT7TbYWlI1.jpg","certification":"N/A","genres":["Comédia","Aventura","Drama","Família"],"trailer":"N/A"},
"9849":{"id":"9849","name":"Meu Marciano Favorito","slug":"meu-marciano-favorito","original_title":"My Favorite Martian","overview":"Após um acidente do espaço, um marciano acaba caindo na Terra. Ele toma forma humana e conhece o repórter de TV Tim O'Hara (Jeff Daniels), que imediatamente acredita ter encontrado o maior furo jornalístico de sua vida. Mas ele é convencido pelo marciano a deixar sua identidade em anonimato e passa a apresentá-lo para as pessoas como seu tio Martin (Christopher Lloyd). A partir daí, os dois começam a viver divertidas histórias e passam por muitas aventuras para guardar esse segredo.","first_air_date":"1999-02-11","runtime":94,"episode_run_time":[94],"vote_average":5.6,"created_by":["Walt Disney Pictures"],"production_companies":[{"name":"Walt Disney Pictures"}],"cast":["Christopher Lloyd","Jeff Daniels","Elizabeth Hurley","Daryl Hannah","Wallace Shawn"],"backdrop_path":"https://image.tmdb.org/t/p/original/1viDPGEPpEZBVwuIotnaXBQNyGQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/JWIvaIlSnzeLUquOdQrqNiJl5F.jpg","certification":"N/A","genres":["Comédia","Família","Ficção científica"],"trailer":"N/A"},
"617786":{"id":"617786","name":"O Rebanho","slug":"o-rebanho","original_title":"The Other Lamb","overview":"Selah (Raffey Cassidy) é uma jovem nascida em um culto repressivo conhecido como \"rebanho\". Todas as mulheres e crianças vivem em um complexo rural e são liderados por um homem, conhecido apenas como \"Pastor\". Selah recebe a grande honra de participar do ritual sagrado do nascimento dos cordeiros, do qual o rebanho depende para sobreviver. Durante a cerimônia, ela passa por uma experiência chocante. A adolescente começa a ter visões estranhas que a fazem questionar sua própria realidade, e tudo o que o Pastor a ensinou.","first_air_date":"2020-04-03","runtime":96,"episode_run_time":[96],"vote_average":5.7,"created_by":["Rumble Films","Subotica","Zentropa Belgium","uMedia"],"production_companies":[{"name":"Rumble Films"},{"name":"Subotica"},{"name":"Zentropa Belgium"},{"name":"uMedia"}],"cast":["Raffey Cassidy","Michiel Huisman","Denise Gough","Eve Connolly","Kelly Campbell"],"backdrop_path":"https://image.tmdb.org/t/p/original/zun99bRRcg7d8C6QrIGU3xJbk5t.jpg","poster_path":"https://image.tmdb.org/t/p/original/2ZZeSKqhbteQ7lDZnse9DmpIQDC.jpg","certification":"N/A","genres":["Terror","Drama","Thriller"],"trailer":"N/A"},
"11933":{"id":"11933","name":"Nada Além de Problemas","slug":"nada-alem-de-problemas","original_title":"Nothing but Trouble","overview":"Valkenvânia é uma região inacreditável quando se fala em armadilhas rodoviárias. Uma entrada proibida feita pelo operador da bolsa de valores Chris e pela advogada Diane para escaparem de um pedágio foi o bastante para que eles se metessem em grandes problemas. Os dois foram capturados pela elite da polícia local e levados para uma corte judicial meio improvisada na casa do juiz de Paz Alvin Valkenheiser, que preside o julgamento do alto dos seus 106 anos de idade.","first_air_date":"1991-02-15","runtime":93,"episode_run_time":[93],"vote_average":5.3,"created_by":["Applied Action","Warner Bros. Pictures"],"production_companies":[{"name":"Applied Action"},{"name":"Warner Bros. Pictures"}],"cast":["Chevy Chase","Dan Aykroyd","John Candy","Demi Moore","Daniel Baldwin"],"backdrop_path":"https://image.tmdb.org/t/p/original/5Uo0vXeg7KDTDwodKy9FC5f5K8N.jpg","poster_path":"https://image.tmdb.org/t/p/original/Apk5Hbby70diyeMHd2VhxUSHNW.jpg","certification":"12","genres":["Comédia","Aventura"],"trailer":"N/A"},
