"34276":{"id":"34276","name":"Os Primeiros Homens na Lua","slug":"os-primeiros-homens-na-lua","original_title":"First Men in the Moon","overview":"A fantástica fábula sobre a vida na Lua está vividamente ilustrada na tela pelo mestre de efeitos especiais Ray Harryhausen neste surpreendente épico de ficção científica com representação de criaturas extraterrestres. O filme começa quando um grupo de astronautas das Nações Unidas está planejando uma nova missão à Lua. Os astronautas estão um tanto confusos e, sobretudo, intrigados com a experiência de um homem (Edward Judd). Este homem diz que quando sua noiva, um cientista e ele fizeram esta viagem à Lua há 65 anos, foram atacados pelos 'Selenitas', grotescas formigas com forma humana que vivem em imensas cavernas de cristal. Agora, cabe a essa equipe das Nações Unidas tentar esta alunissagem, uma missão que poderia ser mais aterrorizante do que se havia pensado.","first_air_date":"1964-07-01","runtime":103,"episode_run_time":[103],"vote_average":6.3,"created_by":["Columbia Pictures","Ameran Films"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Ameran Films"}],"cast":["Edward Judd","Martha Hyer","Lionel Jeffries","Miles Malleson","Norman Bird"],"backdrop_path":"https://image.tmdb.org/t/p/original/ispyRJVbcB3c9y6AhuZdbgMuzi.jpg","poster_path":"https://image.tmdb.org/t/p/original/wxnUJmWNxvvU1RpPo4GKj7421PQ.jpg","certification":"N/A","genres":["Aventura","Ficção científica"],"trailer":"N/A"},
