"47914":{"id":"47914","name":"O Grande Búfalo Branco","slug":"o-grande-bufalo-branco","original_title":"The White Buffalo","overview":"Em setembro de 1874, Wild Bill Hickok (Charles Bronson) vai para o Velho Oeste, usando o nome de James Otis, pois precisa caçar um búfalo branco que sempre lhe provoca estranhos pesadelos. Nesta jornada, acaba fazendo amizade com um chefe índio, que precisa caçar o búfalo por outros motivos.","first_air_date":"1977-05-01","runtime":97,"episode_run_time":[97],"vote_average":5.9,"created_by":["United Artists","The De Laurentiis Company"],"production_companies":[{"name":"United Artists"},{"name":"The De Laurentiis Company"}],"cast":["Charles Bronson","Jack Warden","Will Sampson","Kim Novak","Clint Walker"],"backdrop_path":"https://image.tmdb.org/t/p/original/scf5Fgzbr66IFoqaxYwcmrJG0IA.jpg","poster_path":"https://image.tmdb.org/t/p/original/5iH5LrzCMJmtCyegtWDgnAvIul3.jpg","certification":"N/A","genres":["Faroeste","Aventura","Ação"],"trailer":"N/A"},
"1717":{"id":"1717","name":"A Grande Ilusão","slug":"a-grande-ilusao","original_title":"All the King's Men","overview":"Atingido pelos efeitos da Depressão, há muitos pobres no estado da Louisiana. Neste contexto surge o populista e demagogo Willie Stark (Sean Penn), que diz ser um caipira por ter descoberto que, falando assim, era ouvido pelo povo. Ele é estimulado por um partido de oposição, que busca os votos dos indecisos, a disputar o cargo de governador, sendo convencido pelo manipulador Tiny Duffy (James Gandolfini) e também por um jovem jornalista, Jack Burden (Jude Law). A retórica de Willie cresce e ele não pára de fazer promessas de forma eloqüente, o que faz com que seja eleito governador com a maior margem registrada no estado. Mas o suposto idealismo de Willie com o tempo dá lugar a um questionável modo de agir. Um processo de impeachment contra ele tem andamento e o conhecido juiz Samuel Irwin (Anthony Hopkins) diz a um jornal que há base legal para isto. Willie então incumbe Burden de achar algo \"podre\" no passado do Irwin, para fazê-lo mudar de posição.","first_air_date":"2006-09-10","runtime":129,"episode_run_time":[129],"vote_average":5.8,"created_by":["Relativity Media","Phoenix Pictures","Rising Star Productions","Columbia Pictures","VIP Medienfonds 4"],"production_companies":[{"name":"Relativity Media"},{"name":"Phoenix Pictures"},{"name":"Rising Star Productions"},{"name":"Columbia Pictures"},{"name":"VIP Medienfonds 4"}],"cast":["Sean Penn","Jude Law","Anthony Hopkins","Kate Winslet","Mark Ruffalo"],"backdrop_path":"https://image.tmdb.org/t/p/original/xvUKPJ9PXrh7904qZI0tbNlTMlZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/4evwQPW0BuBvVvp67bTvoRL8PSO.jpg","certification":"16","genres":["Drama","Thriller"],"trailer":"N/A"},
