"17006":{"id":"17006","name":"Vou Te Pegar Otário","slug":"vou-te-pegar-otario","original_title":"I'm Gonna Git You Sucka","overview":"Após a misteriosa morte de seu irmão, Jack Spade (Ivory Wayans) retorna para a sua velha e violenta vizinhança após passar 10 anos nas Forças Armadas. Ao ver a situação em que se encontra o bairro em que cresceu, Spade decide declarar guerra ao crime e, para isso, ele planeja acabar com o reinado do temido Mr. Big (Vernon), o criminoso que comanda tudo. Mas, para isso, ele precisa reunir um verdadeiro exército de valentes homens determinados a limparem o bairro. E, para montar tal exército, Spade convoca o ex-policial John Slade (Casey), seu ídolo de infância e grande nome do combate ao crime dos anos 70. Agora, os criminosos devem ter medo, pois uma improvável equipe de heróis está na área.","first_air_date":"1988-11-10","runtime":88,"episode_run_time":[88],"vote_average":6.4,"created_by":["Ivory Way Productions","Front Films","Raymond Katz Production","United Artists","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Ivory Way Productions"},{"name":"Front Films"},{"name":"Raymond Katz Production"},{"name":"United Artists"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Keenen Ivory Wayans","Bernie Casey","Antonio Fargas","Steve James","Isaac Hayes"],"backdrop_path":"https://image.tmdb.org/t/p/original/z3tAdLDRWqoMgtl349aStimMtIs.jpg","poster_path":"https://image.tmdb.org/t/p/original/jgYAQOJa0ftp3ZBukrBqmXCXAqN.jpg","certification":"16","genres":["Comédia","Ação","Crime"],"trailer":"N/A"},
