"310569":{"id":"310569","name":"Que Horas Ela Volta?","slug":"que-horas-ela-volta","original_title":"Que Horas Ela Volta?","overview":"A pernambucana Val (Regina Casé) se mudou para São Paulo a fim de dar melhores condições de vida para sua filha Jéssica. Com muito receio, ela deixou a menina no interior de Pernambuco para ser babá de Fabinho, morando integralmente na casa de seus patrões. Treze anos depois, quando o menino (Michel Joelsas) vai prestar vestibular, Jéssica (Camila Márdila) lhe telefona, pedindo ajuda para ir à São Paulo, no intuito de prestar a mesma prova. Os chefes de Val recebem a menina de braços abertos, só que quando ela deixa de seguir certo protocolo, circulando livremente, como não deveria, a situação se complica.","first_air_date":"2015-06-04","runtime":112,"episode_run_time":[112],"vote_average":8.0,"created_by":["África Filmes","Gullane Entretenimento","Globo Filmes"],"production_companies":[{"name":"África Filmes"},{"name":"Gullane Entretenimento"},{"name":"Globo Filmes"}],"cast":["Regina Casé","Camila Márdila","Karine Teles","Lourenço Mutarelli","Michel Joelsas"],"backdrop_path":"https://image.tmdb.org/t/p/original/nE4FiaqpI4zdOUKape6msoEM5Dx.jpg","poster_path":"https://image.tmdb.org/t/p/original/y7snoPWbq4qVUqwlmHPTixURapd.jpg","certification":"12","genres":["Drama"],"trailer":"Dffs46VCJ_g"},
"267192":{"id":"267192","name":"O Mestre dos Gênios","slug":"o-mestre-dos-genios","original_title":"Genius","overview":"Biografia de Max Perkins, um dos editores literários mais famosos do mundo. Apostando em jovens talentos, ele descobriu nomes fundamentais da literatura como F. Scott Fitzgerald, Ernest Hemingway e Thomas Wolfe. O filme acompanha a vida pessoal e Perkins e sua relação complicada com os escritores, cujas obras foram fortemente influenciadas pelo trabalho do editor.","first_air_date":"2016-06-10","runtime":104,"episode_run_time":[104],"vote_average":6.5,"created_by":["Pinewood Pictures","Desert Wolf Productions","Michael Grandage Company","Riverstone Pictures","Summit Entertainment"],"production_companies":[{"name":"Pinewood Pictures"},{"name":"Desert Wolf Productions"},{"name":"Michael Grandage Company"},{"name":"Riverstone Pictures"},{"name":"Summit Entertainment"}],"cast":["Colin Firth","Jude Law","Nicole Kidman","Laura Linney","Guy Pearce"],"backdrop_path":"https://image.tmdb.org/t/p/original/CSm8M4uj9ba5jVVhbeBbg9hCyJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/ddJbw9itZVYwv56HzTaZwn9gFbn.jpg","certification":"12","genres":["História","Drama"],"trailer":"1DwX4Fhvnzw"},
"14637":{"id":"14637","name":"Faces da Verdade","slug":"faces-da-verdade","original_title":"Nothing But the Truth","overview":"Uma colunista política de Washington D.C., Rachel Armstrong (Kate Beckinsale) escreve que o Presidente ignorou as descobertas de uma operação secreta da CIA ao ordenar ataques aéreos contra Venezuela. Rachel nomeia a agente Erica Van Doren (Vera Farmiga), uma mulher cuja filha mais nova estuda na mesma turma do filho de Rachel. Ela é detida se recusar a dizer quem foi a sua fonte. Ela não vai mudar de idéia e os dias vão se acumulando. Da mesma forma, o caos domina a vida de Van Doren.","first_air_date":"2008-12-19","runtime":108,"episode_run_time":[108],"vote_average":6.9,"created_by":["Battleplan Productions","Yari Film Group"],"production_companies":[{"name":"Battleplan Productions"},{"name":"Yari Film Group"}],"cast":["Kate Beckinsale","Matt Dillon","Alan Alda","Vera Farmiga","Noah Wyle"],"backdrop_path":"https://image.tmdb.org/t/p/original/dDeqNLUnHCM3jgo7aT98gf8uxVW.jpg","poster_path":"https://image.tmdb.org/t/p/original/7hZx6EWXwuOA7DW7BH9xsh1QkVG.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
