"14684":{"id":"14684","name":"Código de Honra","slug":"codigo-de-honra","original_title":"School Ties","overview":"Vindo de uma família humilde, o jovem David Greene (Bredan Fraser) conseguiu uma bolsa em uma grande e tradicional escola. Lá, ele se torna a estrela do time de futebol americano do colégio, gerando a admiração e a inveja de muitos de seus colegas. Mas tudo muda quando uma verdade vem a tona: David é judeu. A partir daí, os preconceitos ficam cada vez mais visíveis.","first_air_date":"1992-09-18","runtime":106,"episode_run_time":[106],"vote_average":6.5,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Brendan Fraser","Matt Damon","Chris O'Donnell","Randall Batinkoff","Andrew Lowery"],"backdrop_path":"https://image.tmdb.org/t/p/original/3WWQtVKOra73bde9ViwOwq1GnsN.jpg","poster_path":"https://image.tmdb.org/t/p/original/dlLRtzSiCK2PGc4DPFG6ScYS4xG.jpg","certification":"L","genres":["Drama"],"trailer":"N/A"},
