"476678":{"id":"476678","name":"Traição para Iniciantes","slug":"traicao-para-iniciantes","original_title":"Backstabbing for Beginners","overview":"A trama acompanha Michael, um jovem idealista que consegue o emprego dos sonhos nas Nações Unidas e logo se envolve com o programa Petróleo por Comida da ONU. Michael aprende o ofício com Pasha, o diplomata experiente que criou o programa, que se torna seu mentor e sua figura paterna. Com Pasha, Michael aprende que certo e errado são conceitos flexíveis, moldados dentro da ONU para suprir as necessidades de uma causa nobre. A verdade não é uma questão de fatos, e sim de consenso. Orientado por Pasha, Michael se destaca no trabalho e consegue verbas para o Petróleo por Comida. Mas suas ações deixam vítimas. Ao longo do caminho, ele começa a perceber a corrupção no projeto do programa. Quando Michael descobre a profundidade da corrupção no programa Petróleo por Comida, também percebe que teve um papel crucial para garantir os subornos pagos a Saddam Hussein. A única saída será expor tudo, arriscando a vida, a carreira do mentor e a vida da mulher que ama.","first_air_date":"2018-01-18","runtime":108,"episode_run_time":[108],"vote_average":6.1,"created_by":["Fortitude International","Eyeworks Scandi Fiction","Creative Alliance","Unlimited Stories"],"production_companies":[{"name":"Fortitude International"},{"name":"Eyeworks Scandi Fiction"},{"name":"Creative Alliance"},{"name":"Unlimited Stories"}],"cast":["Theo James","Jacqueline Bisset","Ben Kingsley","Rossif Sutherland","Brian Markinson"],"backdrop_path":"https://image.tmdb.org/t/p/original/wnZIPnZHnHjdNuH4LEumkrDsuHr.jpg","poster_path":"https://image.tmdb.org/t/p/original/gM5JdBdz2dGlooyFl2is8l4Ge6e.jpg","certification":"12","genres":["Thriller","Drama","História"],"trailer":"N/A"},
"10410":{"id":"10410","name":"Hoffa: Um Homem, Uma Lenda","slug":"hoffa-um-homem-uma-lenda","original_title":"Hoffa","overview":"História da vida de Jimmy Hoffa (Jack Nicholson), um poderoso líder sindical, que desapareceu misteriosamente, sem nunca ter sido encontrado. Mostra sua luta para construir um sindicato trabalhista, seu envolvimento com a máfia e o tempo que passou na prisão. Personagens reais se misturam com fictícios.","first_air_date":"1992-12-25","runtime":140,"episode_run_time":[140],"vote_average":6.3,"created_by":["Jersey Films","20th Century Fox"],"production_companies":[{"name":"Jersey Films"},{"name":"20th Century Fox"}],"cast":["Jack Nicholson","Danny DeVito","Armand Assante","J. T. Walsh","John C. Reilly"],"backdrop_path":"https://image.tmdb.org/t/p/original/dineJzDZLuEXNNy261vFcJgqhxr.jpg","poster_path":"https://image.tmdb.org/t/p/original/ql9oe0crFp6BFQVRfGZtZkTr3JA.jpg","certification":"N/A","genres":["Crime","História"],"trailer":"N/A"},
