"645689":{"id":"645689","name":"O Duque","slug":"o-duque","original_title":"The Duke","overview":"Em 1961, um taxista de 60 anos roubou o retrato de Goya do duque de Wellington da National Gallery de Londres. Foi o primeiro (e continua sendo o único) roubo na história da Galeria. O que aconteceu a seguir se tornou uma lenda.","first_air_date":"2021-07-23","runtime":95,"episode_run_time":[95],"vote_average":7.0,"created_by":["Pathé","Ingenious Media","Neon Films","Screen Yorkshire"],"production_companies":[{"name":"Pathé"},{"name":"Ingenious Media"},{"name":"Neon Films"},{"name":"Screen Yorkshire"}],"cast":["Jim Broadbent","Helen Mirren","Fionn Whitehead","Matthew Goode","Aimee Kelly"],"backdrop_path":"https://image.tmdb.org/t/p/original/wddNG1To5jUwmX8gwcGjZSpckwg.jpg","poster_path":"https://image.tmdb.org/t/p/original/kL0k4cUHlcM9mfjWuxna9QzxaBN.jpg","certification":"N/A","genres":["Comédia","Drama","História"],"trailer":"N/A"},
"11467":{"id":"11467","name":"Os Queridinhos da América","slug":"os-queridinhos-da-america","original_title":"America's Sweethearts","overview":"Kiki (Julia Roberts) é uma mulher tímida que trabalha para Gwen Harrison (Catherine Zeta-Jones), uma grande estrela do cinema hollywoodiano que está em vias de se separar de seu marido, Eddie Thomas (John Cusack), que também é ator. Porém, como Eddie e Gwen são o casal mais badalado de Hollywood e estão prestes a lançar um novo filme juntos, eles precisam manter as aparências e deixar a impressão para o público e a imprensa de que são um casal feliz. Kiki é justamente a pessoa encarregada de evitar novos atritos entre Gwen e Eddie, mas aos poucos a amizade que possui com ele vai se tornando um romance. Enquanto isso Lee (Billy Crystal), o responsável pela divulgação do novo filme, precisa ainda contar com o casal de atores para desviar a atenção da imprensa de seu grande problema: o fato do diretor Hal (Christopher Walken) não querer liberar o filme.","first_air_date":"2001-07-17","runtime":102,"episode_run_time":[102],"vote_average":5.7,"created_by":["Columbia Pictures","Revolution Studios","Roth-Arnold Productions","Face Productions"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Revolution Studios"},{"name":"Roth-Arnold Productions"},{"name":"Face Productions"}],"cast":["Julia Roberts","John Cusack","Catherine Zeta-Jones","Billy Crystal","Hank Azaria"],"backdrop_path":"https://image.tmdb.org/t/p/original/zgkxHhvbZ8Q2j4cjrHgmwdCeGgt.jpg","poster_path":"https://image.tmdb.org/t/p/original/5unaiZfpchAHJSYVZY12zy5sWqR.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
"19286":{"id":"19286","name":"O Duende Assassino","slug":"o-duende-assassino","original_title":"Leprechaun 3","overview":"Em Las Vegas, o estudante Scott encontra moeda de ouro da sorte e começa a ganhar fortuna no jogo. Mas a moeda pertence ao terrível Duende, que volta à ativa para recuperá-la, aterrorizando o estudante, sua namorada, e todos aqueles que ousam cruzar seu caminho.","first_air_date":"1995-06-27","runtime":90,"episode_run_time":[90],"vote_average":5.9,"created_by":["Trimark Pictures","Blue Rider Pictures"],"production_companies":[{"name":"Trimark Pictures"},{"name":"Blue Rider Pictures"}],"cast":["Warwick Davis","John Gatins","Lee Armstrong","John DeMita","Michael Callan"],"backdrop_path":"https://image.tmdb.org/t/p/original/xGGRgSD7vbkyFwrt24x6cG4ytbp.jpg","poster_path":"https://image.tmdb.org/t/p/original/gwVNSRE1GYUd1Ay6Pg5LFs8r0Aa.jpg","certification":"N/A","genres":["Comédia","Terror"],"trailer":"N/A"},
"14154":{"id":"14154","name":"Jogos de Guerra: O Código Mortal","slug":"jogos-de-guerra-o-codigo-mortal","original_title":"WarGames: The Dead Code","overview":"Bem-vindo ao jogo mortal de sua vida. Colm Feore (Paycheck) e Lanter guerra (Heróis) salário contra a tecnologia militar mais moderno neste novo filme, que dá continuidade ao sucesso espetacular de Jogos de Guerra. De cabeça contra o fundo das Wargames de ação explosivas - O Código Mortal é um intrigante e divertido como o original, mas com todas as surpresas da tecnologia atual para mantê-lo em seus dedos do início ao fim! Quando Will Farmer (Lanter) descobre um jogo online em uma rede limitada, conhecido apenas como Ripley (Ripley), ele não sabe que invadiu o sistema nacional de defesa projetado para detectar e investigar células terroristas em treinamento ... e acaba se tornando o próximo alvo de Ripley! Com sua personalidade aberta, sua família e seus amigos estão em perigo, e sua cidade natal na mira das armas automáticas da resposta militar é a única esperança de Will para limpar seu nome, para ganhar Ripley em seu próprio jogo.","first_air_date":"2008-07-29","runtime":100,"episode_run_time":[100],"vote_average":5.1,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Matt Lanter","Amanda Walsh","Colm Feore","Chuck Shamata","Maxim Roy"],"backdrop_path":"https://image.tmdb.org/t/p/original/s56Wy5SnuxIIx1Kh2tmu5qiVe4z.jpg","poster_path":"https://image.tmdb.org/t/p/original/u1Aqkz6oSyVbx5C7qJMe1WYzuJN.jpg","certification":"N/A","genres":["Ficção científica","Drama","Thriller"],"trailer":"N/A"},
