"13150":{"id":"13150","name":"Força Policial","slug":"forca-policial","original_title":"Pride and Glory","overview":"Uma armadilha faz com que quatro policiais de Nova York sejam assassinados, o que põe em alerta todo o departamento. Francis Tierney, o chefe dos detetives, pede a um de seus filhos, Ray, que lidere a investigação sobre o caso. Inicialmente relutante, Ray assume a função tendo em mente que os policiais mortos já trabalharam para seu irmão, Francis Tierney Jr., e também com seu cunhado, Jimmy Egan. De início o caso aparenta ser uma desastrosa tentativa de desmembrar uma quadrilha de drogas, mas aos poucos Ray descobre que alguém denunciou os policiais aos traficantes","first_air_date":"2008-09-09","runtime":130,"episode_run_time":[130],"vote_average":6.4,"created_by":["New Line Cinema","Solaris Film","O'Connor Brothers","Avery Pix","Kumar Mobiliengesellschaft mbH & Co. Projekt Nr. 1 KG"],"production_companies":[{"name":"New Line Cinema"},{"name":"Solaris Film"},{"name":"O'Connor Brothers"},{"name":"Avery Pix"},{"name":"Kumar Mobiliengesellschaft mbH & Co. Projekt Nr. 1 KG"}],"cast":["Edward Norton","Jon Voight","Colin Farrell","Noah Emmerich","Jennifer Ehle"],"backdrop_path":"https://image.tmdb.org/t/p/original/5B6seAIfg0lMCISu98ycP5c4v2s.jpg","poster_path":"https://image.tmdb.org/t/p/original/tEQIxqW8TZfvBcj4VsNRMtGbdXM.jpg","certification":"16","genres":["Crime","Drama","Mistério","Thriller"],"trailer":"N/A"},
