"72334":{"id":"72334","name":"Chimpanzé","slug":"chimpanze","original_title":"Chimpanzee","overview":"Viaje até a selva africana e conheça Oscar, um adorável e jovem chimpanzé que vê a vida de um jeito divertido. O mundo é um parque de diversões para o pequeno Oscar e seus jovens companheiros chimpanzés, que adoram fazer bagunça. Com muita curiosidade, vontade de descobrir as coisas e alegria de imitar os outros, os chimpanzés são umas das criaturas mais extraordinárias do reino animal.","first_air_date":"2012-04-20","runtime":78,"episode_run_time":[78],"vote_average":7.0,"created_by":["Disneynature"],"production_companies":[{"name":"Disneynature"}],"cast":["Tim Allen"],"backdrop_path":"https://image.tmdb.org/t/p/original/fJkPTmjYlNWX1yTDkQjw7jbroaT.jpg","poster_path":"https://image.tmdb.org/t/p/original/27PNnx2ytnc9JWCQ51r9z65ctQJ.jpg","certification":"Livre","genres":["Documentário"],"trailer":"N/A"},
