"8198":{"id":"8198","name":"O Americano Tranquilo","slug":"o-americano-tranquilo","original_title":"The Quiet American","overview":"Em 1952 Saigon está em plena guerra, envolvida na luta pela libertação do local do domínio francês. É nesta época que chega Alden Pyle (Brendan Fraser), um agente da CIA idealista que é enviado para ajudar as forças locais. Lá ele conhece Thomas Fowler (Michael Caine), um veterano correspondente do jornal London Times, que lhe apresenta Phuong (Do Thi Hai Yen), uma bela vietnamita com quem está envolvido. Logo Pyle também se envolve com Phuong, criando um triângulo amoroso que traz uma série de revelações à tona.","first_air_date":"2002-11-22","runtime":101,"episode_run_time":[101],"vote_average":6.5,"created_by":["Mirage Enterprises","IMF Internationale Medien und Film GmbH & Co. 2. Produktions KG","Giai Phong Film Studio","Saga Pictures","Miramax","Intermedia","Senator International","Pacifica Film"],"production_companies":[{"name":"Mirage Enterprises"},{"name":"IMF Internationale Medien und Film GmbH & Co. 2. Produktions KG"},{"name":"Giai Phong Film Studio"},{"name":"Saga Pictures"},{"name":"Miramax"},{"name":"Intermedia"},{"name":"Senator International"},{"name":"Pacifica Film"}],"cast":["Michael Caine","Brendan Fraser","Do Thi Hai Yen","Tzi Ma","Rade Šerbedžija"],"backdrop_path":"https://image.tmdb.org/t/p/original/a6ZQn9r1xCkOY6mAIbQfVsqhQbh.jpg","poster_path":"https://image.tmdb.org/t/p/original/f0QGSLPxHa9Rq31VgxDCg8g7lvU.jpg","certification":"N/A","genres":["Romance","Thriller","Drama","Guerra"],"trailer":"N/A"},
"503902":{"id":"503902","name":"Sabrina","slug":"sabrina","original_title":"Sabrina","overview":"Maira vive feliz com Aiden um fabricante de bonecas e dono de uma empresa de brinquedos, mas Vanya, sua filha adotiva e sobrinha de Aiden, ainda está lidando com a perda de sua mãe biológica. Depois que Vanya toca o Lápis de Charlie para invocar sua falecida mãe, coisas estranhas começam a acontecer. Maira é aterrorizada pela boneca Sabrina. O que está acontecendo com a boneca e o que ela quer?","first_air_date":"2018-07-12","runtime":98,"episode_run_time":[98],"vote_average":5.4,"created_by":["Hitmaker Studios","Hitmaker Studios"],"production_companies":[{"name":"Hitmaker Studios"},{"name":"Hitmaker Studios"}],"cast":["Luna Maya","Christian Sugiono","Sara Wijayanto","Demian Aditya","Asri Handayani"],"backdrop_path":"https://image.tmdb.org/t/p/original/rXA03j9HBzhcmgjJetcVSjkmwQg.jpg","poster_path":"https://image.tmdb.org/t/p/original/djHPD5qPIKT7m06xPuq4rZ3Slr4.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
