"420622":{"id":"420622","name":"Professor Marston e as Mulheres-Maravilhas","slug":"professor-marston-e-as-mulheres-maravilhas","original_title":"Professor Marston and the Wonder Women","overview":"A não-convencional vida de Wiliam Marston, psicólogo e inventor de Harvard que ajudou a tornar real o Detector de Mentiras e que também criou a Mulher-Maravilha, personagem dos quadrinhos, em 1941. Marston mantinha uma relação polígama envolvendo sua esposa Elizabeth Marston, psicóloga e inventora, e Olive Byrne, uma ex-aluna que virou acadêmica. Essa relação e os ideais feministas das duas mulheres foram essenciais para a criação da personagem.","first_air_date":"2017-10-13","runtime":108,"episode_run_time":[108],"vote_average":7.2,"created_by":["Topple Productions","Boxspring Entertainment","Opposite Field Pictures"],"production_companies":[{"name":"Topple Productions"},{"name":"Boxspring Entertainment"},{"name":"Opposite Field Pictures"}],"cast":["Luke Evans","Rebecca Hall","Bella Heathcote","Connie Britton","JJ Feild"],"backdrop_path":"https://image.tmdb.org/t/p/original/ecinn4iRxpQs4mW7Y7n0b41Qgbe.jpg","poster_path":"https://image.tmdb.org/t/p/original/9Mk4VMhOnRa6lTMNcJ7lpxbRsrr.jpg","certification":"16","genres":["Drama","Romance"],"trailer":"N/A"},
"19610":{"id":"19610","name":"Nasce Uma Estrela","slug":"nasce-uma-estrela","original_title":"A Star Is Born","overview":"Um astro do rock se envolve românticamente com cantora iniciante. Ele a ajuda a subir na carreira, mas a medida que ela vai se tornando também uma estrela, o cantor começa seu rápido declínio em função do abuso de alcóol e drogas. Ela tenta retribuir a ajuda, mas o cantor a rejeita, prejudicando definitivamente o relacionamento. Mesmo estando os dois apaixonados.","first_air_date":"1976-12-17","runtime":140,"episode_run_time":[140],"vote_average":6.0,"created_by":["Barwood Films","Warner Bros. Pictures","First Artists"],"production_companies":[{"name":"Barwood Films"},{"name":"Warner Bros. Pictures"},{"name":"First Artists"}],"cast":["Barbra Streisand","Kris Kristofferson","Gary Busey","Oliver Clark","Venetta Fields"],"backdrop_path":"https://image.tmdb.org/t/p/original/kPn4M9dw7raRVQt2UPOWY0j2k0o.jpg","poster_path":"https://image.tmdb.org/t/p/original/hfLPNqDfoa4iGKYw3jJmO94fR6f.jpg","certification":"N/A","genres":["Drama","Música","Romance"],"trailer":"N/A"},
