"14536":{"id":"14536","name":"Recém Chegada","slug":"recem-chegada","original_title":"New in Town","overview":"Lucy Hill (Renée Zellweger) é uma poderosa e ambiciosa executiva, apaixonada pelo estilo de vida que leva em Miami - roupas, sapatos, carros e belos homens. Quando surge a chance de reestruturar uma fabrica, no meio do nada, no gélido estado de Minnesota, Lucy vê a chance de uma promoção e aceita num estalar de dedos. Mas, o que seria apenas mais um trabalho se transforma numa tremenda roubada. Com seu modo de vida arrogante, a recém-chegada executiva, enfrentará situações hilárias ao ser recebida com frieza pela população da pequena cidade e em especial pelo bonitão e sindicalista Ted (Harry Connick, Jr.)","first_air_date":"2009-01-30","runtime":97,"episode_run_time":[97],"vote_average":5.8,"created_by":["The Safran Company","Gold Circle Films","Epidemic Pictures","Edmonds Entertainment Group","Lionsgate","Mandate International"],"production_companies":[{"name":"The Safran Company"},{"name":"Gold Circle Films"},{"name":"Epidemic Pictures"},{"name":"Edmonds Entertainment Group"},{"name":"Lionsgate"},{"name":"Mandate International"}],"cast":["Renée Zellweger","Harry Connick Jr.","J.K. Simmons","Siobhan Fallon Hogan","Mike O'Brien"],"backdrop_path":"https://image.tmdb.org/t/p/original/tZF23SGsjhvzZvtorHLni1BcYYs.jpg","poster_path":"https://image.tmdb.org/t/p/original/blMy0CeB43JDA6P5pQl8QGL8kn5.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
