"909":{"id":"909","name":"Agora Seremos Felizes","slug":"agora-seremos-felizes","original_title":"Meet Me in St. Louis","overview":"No ano que antecedeu a Feira Mundial de St. Louis de 1904, as quatro filhas dos Smith aprendem lições de vida e amor, mesmo que se preparem para uma mudança relutante para Nova York. Agora Seremos Felizes é muito mais que um musical. É a encantadora história de uma família na virada do século, repleta de magias e recordações. Judy Garland é Esther Smith, uma garota da agitada cidade de St. Louis que, junto com sua família, tem que se mudar para Nova York. Como se não bastasse deixar todos os seus amigos para trás, ela ainda irá perder a sensacional Feira Mundial de St. Louis de 1904. Esther precisa fazer alguma coisa para evitar essa tragédia!","first_air_date":"1944-11-28","runtime":113,"episode_run_time":[113],"vote_average":7.0,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Judy Garland","Margaret O'Brien","Mary Astor","Lucille Bremer","Leon Ames"],"backdrop_path":"https://image.tmdb.org/t/p/original/fQ93o3wVSIe0dXMLTVTBHoqWwew.jpg","poster_path":"https://image.tmdb.org/t/p/original/6BeXfI1cWNARoMqoHTdwOXt6SHb.jpg","certification":"N/A","genres":["Comédia","Drama","Romance","Família"],"trailer":"N/A"},
"317557":{"id":"317557","name":"Rainha de Katwe","slug":"rainha-de-katwe","original_title":"Queen of Katwe","overview":"Phiona Mutesi é uma jovem de Uganda que faz de tudo para alcançar o seu objetivo de se tornar uma das melhores jogadoras de xadrez do mundo. Órfã de pai e moradora de uma região bem pobre, Mutesi foi obrigada a largar a escola por falta de dinheiro, mas agora está decidida a enfrentar todos os obstáculos para tornar seu sonho realidade.","first_air_date":"2016-09-23","runtime":124,"episode_run_time":[124],"vote_average":7.2,"created_by":["Cine Mosaic","Mirabai Films"],"production_companies":[{"name":"Cine Mosaic"},{"name":"Mirabai Films"}],"cast":["Madina Nalwanga","David Oyelowo","Lupita Nyong'o","Martin Kabanza","Taryn \"Kay\" Kyaze"],"backdrop_path":"https://image.tmdb.org/t/p/original/awZwLXuPAGZEARF3y18S3qWt5LH.jpg","poster_path":"https://image.tmdb.org/t/p/original/dYOzbMAJ9xwS3OUDVVbKaBa5h7u.jpg","certification":"10","genres":["Drama"],"trailer":"N/A"},
