"11157":{"id":"11157","name":"Ela é o Diabo","slug":"ela-e-o-diabo","original_title":"She-Devil","overview":"Mary Fisher (Meryl Streep) é uma escritora de sucesso que escreve romances de segunda categoria. Uma noite em um jantar elegante Ruth (Roseanne Barr), a desalinhada esposa de Bob (Ed Begley Jr.), acidentalmente derrama vinho sobre o belo vestido rosa de Mary. Bob corre para ajudar Mary, eles olham um no olho do outro e sentem desejo à primeira vista. Após uns poucos encontros clandestinos, Bob abandona Ruth e seus dois filhos para morar à beira-mar no palacete de Mary. Ruth está decidida em destruir a vida de Bob, sendo chamada de demoníaca por ele. Ruth interpreta o papel com todo o vigor, primeiro destruindo a vida particular de Bob, depois sua carreira e então a liberdade dele. Quando Bob não tem mais nada, ela continua a persegui-lo.","first_air_date":"1989-12-08","runtime":99,"episode_run_time":[99],"vote_average":5.9,"created_by":["Orion Pictures"],"production_companies":[{"name":"Orion Pictures"}],"cast":["Meryl Streep","Roseanne Barr","Ed Begley Jr.","Linda Hunt","Sylvia Miles"],"backdrop_path":"https://image.tmdb.org/t/p/original/vHRxxSB9oiZvRyBlLAs3KZkM6T.jpg","poster_path":"https://image.tmdb.org/t/p/original/mrssMzL7m9M0D1ZwJ3jMxSBDyaS.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"457837":{"id":"457837","name":"O Clã das Adagas","slug":"o-cla-das-adagas","original_title":"绣春刀II：修罗战场","overview":"Durante a Batalha de Sarhu, o exército Ming está prestes a ser subjugado pelas tropas inimigas. No meio do inferno da guerra, o soldado Shen Lian salva a vida do oficial Lu Wenzhou. Oito anos depois, Lian é um respeitado oficial da polícia secreta imperial, apadrinhado pelo homem que ele salvou no passado. No ambiente corrupto e cheio de intrigas, o honesto Lian incomoda. Quando ele investiga um crime que parece político, uma conspiração para derrubar Lian começa a se desenrolar – ele é acusado de uma série de assassinatos. Seus únicos aliados são um detetive rival e uma misteriosa jovem.","first_air_date":"2017-06-18","runtime":120,"episode_run_time":[120],"vote_average":6.8,"created_by":["东阳坏猴子影视文化传播有限公司"],"production_companies":[{"name":"东阳坏猴子影视文化传播有限公司"}],"cast":["張震","杨幂","Zhang Yi","雷佳音","辛芷蕾"],"backdrop_path":"https://image.tmdb.org/t/p/original/3DKq152scTsUv0ygEh6vSXbrNX.jpg","poster_path":"https://image.tmdb.org/t/p/original/pVLnRVJ9zoUVQgcAbLg15ztkiwf.jpg","certification":"N/A","genres":["Romance","Ação","Drama","História"],"trailer":"N/A"},
"9460":{"id":"9460","name":"Máscara Negra","slug":"mascara-negra","original_title":"黑俠","overview":"Ex-membro do esquadrão 701, grupo de elite de assassinos formados num lugar desconhecido ao norte da China, Tsui teve seu centro nervoso removido cirurgicamente, deixando de sentir qualquer dor física e emocional. Desmoralizado pelas mudanças dramáticas a que foi forçado, Tsui foge para o anonimato e dá vida a um novo personagem. Ele agora é o Máscara Negra, um misterioso lutador que transformou-se numa verdadeira arma letal contra o império das drogas.","first_air_date":"1996-11-07","runtime":96,"episode_run_time":[96],"vote_average":6.2,"created_by":["Win's Entertainment Ltd.","Film Workshop","Distant Horizon"],"production_companies":[{"name":"Win's Entertainment Ltd."},{"name":"Film Workshop"},{"name":"Distant Horizon"}],"cast":["Jet Li","劉青雲","莫文蔚","Françoise Yip","Kong Lung"],"backdrop_path":"https://image.tmdb.org/t/p/original/vZkoEzFdNuAEAZeJqLS7JxWPyxw.jpg","poster_path":"https://image.tmdb.org/t/p/original/53tgL9U4WAaln5fAsJN1eMSZvk7.jpg","certification":"14","genres":["Ação"],"trailer":"N/A"},
