"11425":{"id":"11425","name":"Querida, Encolhi a Gente","slug":"querida-encolhi-a-gente","original_title":"Honey, We Shrunk Ourselves","overview":"O inventor maluco Wayne Szalinsky e sua incrível máquina de encolher são a causa desta nova confusão em Querida, Encolhi a Gente. Parece que encolher crianças em Querida, Encolhi as Crianças não foi suficiente para Wayne, que agora encolhe a ele mesmo, seu próprio irmão e as esposas dos dois. O pânico toma conta das quatro minúsculas criaturas que tentam desesperadamente conseguir a ajuda de seus filhos. Suas fantásticas aventuras incluem uma trilha desgovernada num carrinho de brinquedo, a fúria de uma barata monstruosa, uma carona numa colorida bolha de sabão e um pouso acidental numa tigela de molho em plena reunião de adolescentes. Recheado de efeitos especiais e surpresas engraçadas, este filme é uma comédia tamanho família que você vai adorar.","first_air_date":"1997-03-18","runtime":74,"episode_run_time":[74],"vote_average":5.4,"created_by":["Walt Disney Home Video"],"production_companies":[{"name":"Walt Disney Home Video"}],"cast":["Rick Moranis","Bug Hall","Allison Mack","Robin Bartlett","Stuart Pankin"],"backdrop_path":"https://image.tmdb.org/t/p/original/gIhLlTYILo2BP6xt2KeBNxQDN4E.jpg","poster_path":"https://image.tmdb.org/t/p/original/txUoJzA5MQjIDB9fJ6TJr0NKBby.jpg","certification":"N/A","genres":["Aventura","Comédia","Família","Ficção científica"],"trailer":"N/A"},
