"410718":{"id":"410718","name":"Seremos História?","slug":"seremos-historia","original_title":"Before the Flood","overview":"Um problema de longas datas está se mostrando cada vez mais grave. Mudanças de temperatura, inundações, e outros fenômenos semelhantes têm se tornado cada vez mais comum, e o que tem sido feito na tentativa de amenizar essa situação? É na busca por respostas para essas questões que Leonardo DiCaprio abraça a missão de testemunhar as mudanças climáticas em diversos países, e de uma forma nunca vista antes.","first_air_date":"2016-10-21","runtime":95,"episode_run_time":[95],"vote_average":7.7,"created_by":["RatPac Documentary Films","Appian Way","National Geographic","Diamond Docs"],"production_companies":[{"name":"RatPac Documentary Films"},{"name":"Appian Way"},{"name":"National Geographic"},{"name":"Diamond Docs"}],"cast":["Leonardo DiCaprio","Bill Clinton","John Kerry","Barack Obama","Elon Musk"],"backdrop_path":"https://image.tmdb.org/t/p/original/mGBmiWmi7JqeTWnrPicRbkXcsuO.jpg","poster_path":"https://image.tmdb.org/t/p/original/roXAdppky4GRcwCi8JQ9GLhJDoq.jpg","certification":"14","genres":["Documentário"],"trailer":"zFfurx3RZqo"},
