"10575":{"id":"10575","name":"Paraíso","slug":"paraiso","original_title":"Heaven","overview":"Turim. Quatro inocentes morrem em um atentado. Phillippa (Cate Blanchett), uma professora de inglês, não oferece resistência e permite que a prendam. Ela não nega seu ato, sua culpa. Mas seu alvo era outra pessoa: um traficante. Um jovem policial (Giovanni Ribisi) é o único que acredita na história da inglesa, pois está secretamente apaixonado por ela. Ele desenvolve um plano que lhe devolverá a liberdade, mesmo que isto custe sua carreira ou até mesmo sua vida. Ele sabe que não deve pedir nada em troca para provar seu amor. E sabe que não pode se arrepender de sua decisão.","first_air_date":"2002-02-06","runtime":97,"episode_run_time":[97],"vote_average":6.4,"created_by":["Miramax","X Filme Creative Pool","Mirage Enterprises","Noé Productions"],"production_companies":[{"name":"Miramax"},{"name":"X Filme Creative Pool"},{"name":"Mirage Enterprises"},{"name":"Noé Productions"}],"cast":["Cate Blanchett","Giovanni Ribisi","Remo Girone","Stefania Rocca","Alessandro Sperduti"],"backdrop_path":"https://image.tmdb.org/t/p/original/i2Qu0ZLOvNONkHZRuqxII9QkbTX.jpg","poster_path":"https://image.tmdb.org/t/p/original/8mxmbB5qBrq3dgaQlV875pYL75I.jpg","certification":"N/A","genres":["Drama","Thriller","Romance","Crime"],"trailer":"N/A"},
