"11857":{"id":"11857","name":"Correndo Atrás do Diploma","slug":"correndo-atras-do-diploma","original_title":"Orange County","overview":"Shaun Brumder (Colin Hanks) é um adolescente amável que vive em Orange County, Califórnia, e é completamente apaixonado por surf. Um acidente com um amigo quando estava surfando faz com Shaun reavalie sua vida e encontre um verdadeiro tesouro: uma cópia do romance \"Straight Jacket\", de Marcus Skinner (Kevin Kline). O livro faz com que floresça em Shaun o desejo de se tornar escritor, fazendo com que ele se dedique nos estudos para que possa ser aceito na Universidade de Stanford, onde o próprio Skinner leciona. Com notas altas e um trabalho final impecável, Shaun espera ansiosamente a resposta de Stanford sobre seu ingresso na faculdade. Até que, para sua desilusão, Shaun é rejeitado. Buscando descobrir o que pode ter ocorrido, Shaun descobre que houve um engano na direção de sua escola no envio de suas notas para Stanford. Ele resolve então partir numa tentativa desesperada de entrar para a universidade, mas tem apenas 24 horas para corrigir o engano ocorrido.","first_air_date":"2002-01-11","runtime":82,"episode_run_time":[82],"vote_average":6.0,"created_by":["MTV Films","Paramount Pictures","Scott Rudin Productions"],"production_companies":[{"name":"MTV Films"},{"name":"Paramount Pictures"},{"name":"Scott Rudin Productions"}],"cast":["Colin Hanks","Jack Black","Schuyler Fisk","Catherine O'Hara","John Lithgow"],"backdrop_path":"https://image.tmdb.org/t/p/original/xvSwVUZ85vaGbBir0OllTGxtG4R.jpg","poster_path":"https://image.tmdb.org/t/p/original/lmLcncTWV78v91tKBmI5ytjKvOc.jpg","certification":"12","genres":["Comédia","Drama"],"trailer":"N/A"},
"17941":{"id":"17941","name":"Segredo de Sangue","slug":"segredo-de-sangue","original_title":"Hush","overview":"Em Nova York Helen (Gwyneth Paltrow), uma jovem mulher que vive com Jackson (Johnathon Schaech), seu namorado, descobre que está grávida. Assim decidem se casar e, como ele é dono de Kilronan, uma bela propriedade rural que precisa de melhoramentos, se mudam para lá, planejando trabalhar na propriedade e ter o filho lá. Mas Martha Baring (Jessica Lange), a neurótica mãe dele que sempre administrou o local, se incomoda com a presença da nora e faz planos para ter o controle da situação, seguindo ao pé da letra a regra que diz que os fins justificam os meios.","first_air_date":"1998-03-06","runtime":96,"episode_run_time":[96],"vote_average":5.6,"created_by":["TriStar Pictures"],"production_companies":[{"name":"TriStar Pictures"}],"cast":["Jessica Lange","Gwyneth Paltrow","Johnathon Schaech","Nina Foch","Debi Mazar"],"backdrop_path":"https://image.tmdb.org/t/p/original/rMCZoAVjXmZq26ujyq84khtRG4P.jpg","poster_path":"https://image.tmdb.org/t/p/original/pP20gqAQufFiWryER7T69ywGbS4.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
"35588":{"id":"35588","name":"Gerônimo: Uma Lenda Americana","slug":"geronimo-uma-lenda-americana","original_title":"Geronimo: An American Legend","overview":"Por volta de 1880, o texano jovem oficial Segundo-tenente Britton Davis chega ao Oeste para seu primeiro serviço militar durante a Campanha contra os índios e conhece o valoroso Primeiro-tenente Charles B. Gatewood, de família sulista e que respeita a cultura apache. Gatewood recebe ordens de negociar a rendição do apache renegado Gerônimo e ele e Davis se encontram com o índio, que concorda em acompanhá-los até a Reserva de San Carlos e se entregar ao General George Crook. Gerônimo logo fica insatisfeito com o confinamento dele e seu povo na reserva e depois de um incidente envolvendo a morte do xamã Sonhador pelos soldados americanos, foge do local com metade dos índios, iniciando uma nova guerra contra os brancos.","first_air_date":"1993-12-10","runtime":115,"episode_run_time":[115],"vote_average":6.3,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Jason Patric","Gene Hackman","Robert Duvall","Wes Studi","Matt Damon"],"backdrop_path":"https://image.tmdb.org/t/p/original/6YSj3paJAn3p6F6cyfSdgLncFTQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/9FNuwnhHngkblD6eVRXnmJN8kQq.jpg","certification":"12","genres":["Faroeste","História","Ação","Drama"],"trailer":"N/A"},
