"11861":{"id":"11861","name":"Colcha de Retalhos","slug":"colcha-de-retalhos","original_title":"How to Make an American Quilt","overview":"Enquanto elabora sua tese e se prepara para se casar Finn Dodd (Winona Ryder), uma jovem mulher, vai morar na casa da sua avó (Ellen Burstyn). Lá estão várias amigas da família, que preparam uma elaborada colcha de retalhos como presente de casamento. Enquanto o trabalho é feito ela ouve o relato de paixões e envolvimentos, nem sempre moralmente aprováveis mas repletos de sentimentos, que estas mulheres tiveram. Neste meio tempo ela se sente atraída por um desconhecido, criando dúvidas no seu coração que precisam ser esclarecidas.","first_air_date":"1995-10-06","runtime":117,"episode_run_time":[117],"vote_average":6.4,"created_by":["Universal Pictures","Amblin Entertainment"],"production_companies":[{"name":"Universal Pictures"},{"name":"Amblin Entertainment"}],"cast":["Winona Ryder","Anne Bancroft","Ellen Burstyn","Kate Nelligan","Jean Simmons"],"backdrop_path":"https://image.tmdb.org/t/p/original/iIPllShmdO66FK6kbncIkdA4O98.jpg","poster_path":"https://image.tmdb.org/t/p/original/lge3PeJX2Ri1H8aRKwKs1UaTCoF.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"376134":{"id":"376134","name":"A Descoberta","slug":"a-descoberta","original_title":"The Discovery","overview":"Um ano após a existência da vida após a morte ser comprovada cientificamente, milhões de pessoas recorrem ao suicídio para chegar lá. Um homem e uma mulher se apaixonam nesse cenário nada propício ao amor enquanto tentam aceitar as suas próprias tragédias pessoais e descobrir a verdadeira natureza do pós-vida. The Discovery é mais um filme original Netflix, e estreia em 31 de março.","first_air_date":"2017-03-31","runtime":102,"episode_run_time":[102],"vote_average":6.3,"created_by":["Protagonist Pictures","Endgame Entertainment"],"production_companies":[{"name":"Protagonist Pictures"},{"name":"Endgame Entertainment"}],"cast":["Jason Segel","Rooney Mara","Robert Redford","Jesse Plemons","Riley Keough"],"backdrop_path":"https://image.tmdb.org/t/p/original/dA7YLnc5ztTGiVPWz3GsaMRRz9r.jpg","poster_path":"https://image.tmdb.org/t/p/original/lgLyPfWHkmt8v8ulz04NL2FFHQ4.jpg","certification":"N/A","genres":["Drama","Romance","Ficção científica","Thriller","Mistério"],"trailer":"N/A"},
"1000081":{"id":"1000081","name":"Sentinelle: Desafinando em Dobro","slug":"sentinelle-desafinando-em-dobro","original_title":"Sentinelle","overview":"François Sentinelle tem uma vida dupla. Durante o dia, ele é o policial mais famoso da Ilha da Reunião, conhecido por suas abordagens rígidas e camisas floridas, perseguindo criminosos em seu famoso Defender amarelo. Mas, no restante do tempo, Sentinelle também é um charmoso cantor.","first_air_date":"2023-08-27","runtime":98,"episode_run_time":[98],"vote_average":5.2,"created_by":["22h22","Les films entre 2 et 4"],"production_companies":[{"name":"22h22"},{"name":"Les films entre 2 et 4"}],"cast":["Jonathan Cohen","Raphaël Quenard","Emmanuelle Bercot","Gustave Kervern","Ramzy Bedia"],"backdrop_path":"https://image.tmdb.org/t/p/original/jzdVz28uko3lGxuHFYI4n9vPBBe.jpg","poster_path":"https://image.tmdb.org/t/p/original/wrFg0Q1kqfOhxlRvb8Dle7WF58F.jpg","certification":"N/A","genres":["Ação","Comédia","Crime"],"trailer":"N/A"},
"21641":{"id":"21641","name":"Maldito Futebol Clube","slug":"maldito-futebol-clube","original_title":"The Damned United","overview":"Uma história repleta de humor, relatando os confrontos de Brian Clough e seus fatídicos 44 dias no cargo de dirigente de um time campeão de futebol da Inglaterra, o United. O problema é que ele não terá ao seu lado o fiel parceiro Peter Taylor. Resultado? Em pouco mais de um mês, Brian surpreende, provando sua agressividade e brilhantismo à frente do seu time.","first_air_date":"2009-03-27","runtime":98,"episode_run_time":[98],"vote_average":7.2,"created_by":["BBC Film","Screen Yorkshire","Left Bank Pictures","Columbia Pictures","Sony Pictures Classics"],"production_companies":[{"name":"BBC Film"},{"name":"Screen Yorkshire"},{"name":"Left Bank Pictures"},{"name":"Columbia Pictures"},{"name":"Sony Pictures Classics"}],"cast":["Michael Sheen","Timothy Spall","Colm Meaney","Jim Broadbent","Maurice Roëves"],"backdrop_path":"https://image.tmdb.org/t/p/original/cw8z9H963CtcqchtEEzqs3Ls1wC.jpg","poster_path":"https://image.tmdb.org/t/p/original/ftlbCma6QoRiZgiflVmLuPKHrkq.jpg","certification":"12","genres":["Drama","História"],"trailer":"N/A"},
"5544":{"id":"5544","name":"Hiroshima, Meu Amor","slug":"hiroshima-meu-amor","original_title":"Hiroshima mon amour","overview":"Hiroshima, 1959. Uma atriz francesa casada veio de Paris para trabalhar num filme sobre a paz. Ela tem um affair com um arquiteto japonês também casado, cuja esposa está viajando. Nos dois dias que passam juntos várias lembranças vêem à tona enquanto esperam, de forma aflita, a hora da partida dela. Ela conta que foi \"tosquiada\", pois se apaixonou por um alemão quando tinha apenas 18 anos e morava em Nevers, sendo libertada no dia em que seu amor foi morto, já no final da 2ª Guerra Mundial. Por ter amado um inimigo ela foi aprisionada por sua família numa fria e escura adega e agora, 14 anos depois, novamente sente o gosto de viver um amor quase impossível.","first_air_date":"1959-06-10","runtime":92,"episode_run_time":[92],"vote_average":7.7,"created_by":["Argos Films","Como Films","Daiei Film","Pathé Overseas","Pathé Entertainment"],"production_companies":[{"name":"Argos Films"},{"name":"Como Films"},{"name":"Daiei Film"},{"name":"Pathé Overseas"},{"name":"Pathé Entertainment"}],"cast":["Emmanuelle Riva","岡田英次","Stella Dassas","Pierre Barbaud","Bernard Fresson"],"backdrop_path":"https://image.tmdb.org/t/p/original/fG3h0YLBfE66sFlnd6MSnPQCahC.jpg","poster_path":"https://image.tmdb.org/t/p/original/mxxpqHgrbcOMBju6HeyXvLbgJKV.jpg","certification":"N/A","genres":["Drama","História","Romance"],"trailer":"N/A"},
