"339792":{"id":"339792","name":"David Brent: A Vida na Estrada","slug":"david-brent-a-vida-na-estrada","original_title":"David Brent: Life on the Road","overview":"A câmera alcança David Brent, um ex-astro da série britânica “The Office” e como ele se imagina agora como uma estrela do Rock na estrada.Quinze anos após o trabalho como chefe da empresa Wernham Hogg, David Brent (Ricky Gervais) trabalha como representante de vendas de produtos de limpeza. No entanto, ele ainda sonha em se tornar um astro da música. Um dia, David decide financiar a sua própria turnê pelo Reino Unido, com uma câmera registrando os seus passos na intenção de criar um documentário.","first_air_date":"2016-08-19","runtime":90,"episode_run_time":[90],"vote_average":6.1,"created_by":["BBC Comedy"],"production_companies":[{"name":"BBC Comedy"}],"cast":["Ricky Gervais","Ben Bailey Smith","Rebecca Gethings","Jo Hartley","Andrew Brooke"],"backdrop_path":"https://image.tmdb.org/t/p/original/Afs2EfDfnacxLa2qSZ4ji9LEsru.jpg","poster_path":"https://image.tmdb.org/t/p/original/dSXemEW7dv4KEGmfb96YWmKIcTo.jpg","certification":"14","genres":["Comédia","Música"],"trailer":"N/A"},
