"316042":{"id":"316042","name":"Relatos de Guerra","slug":"relatos-de-guerra","original_title":"Hyena Road","overview":"Um atirador de elite que nunca se permitiu em pensar os alvos como humanos começa a se incomodar com um deles. Um oficial da inteligência que nunca se contemplou em matar, se torna um motor de um complô para assassinatos. E um lendário engenheiro que havia colocado a guerra para trás, agora é o centro de uma zona de batalha. Três homens diferentes de três mundos diferentes estão na intersecção da guerra moderna. Para cada um deles, a guerra tem significados singulares e suas realidades, muitas vezes obscuras de moralidade, demonstram que nem tudo é o que parece.","first_air_date":"2015-10-09","runtime":120,"episode_run_time":[120],"vote_average":6.8,"created_by":["Rhombus Media","International Traders","Buffalo Gal Pictures","Triple 7 Films","Bron Studios","Whizbang Films"],"production_companies":[{"name":"Rhombus Media"},{"name":"International Traders"},{"name":"Buffalo Gal Pictures"},{"name":"Triple 7 Films"},{"name":"Bron Studios"},{"name":"Whizbang Films"}],"cast":["Paul Gross","Rossif Sutherland","Clark Johnson","Allan Hawco","Christine Horne"],"backdrop_path":"https://image.tmdb.org/t/p/original/mEY0A0qJLYSnIPpjNtafB6CTdqn.jpg","poster_path":"https://image.tmdb.org/t/p/original/rlZMz2aplYK6AFtQ18CFQTE1Q7M.jpg","certification":"16","genres":["Guerra","Drama","Thriller","Ação"],"trailer":"N/A"},
