"19274":{"id":"19274","name":"A Vingança do Dragão","slug":"a-vinganca-do-dragao","original_title":"笑拳怪招","overview":"Shing Lung, um jovem rapaz do interior treina com seu avô, um grande mestre, o segredo do tradicional Kung Fu. Contra a vontade de seu avô passa a lutar por dinheiro, para ajudar no sustento de seu mestre que encontra-se doente. Até que seu avô encontra um velho inimigo, líder de uma facção criminosa que o mata covardemente. Desesperado e com sede de vingança, não mede conseqüências para tentar vingar a morte do seu grande mestre.","first_air_date":"1979-02-17","runtime":97,"episode_run_time":[97],"vote_average":6.7,"created_by":["Good Year Movie Company"],"production_companies":[{"name":"Good Year Movie Company"}],"cast":["Jackie Chan","田俊","任世官","Chen Hui-Lou","Cheng Fu-Hung"],"backdrop_path":"https://image.tmdb.org/t/p/original/jN1l0dIjZfH4r3NjUPl8KeZ8sd3.jpg","poster_path":"https://image.tmdb.org/t/p/original/5p5zpWZ8owERYSQPyAxpSVWLKga.jpg","certification":"N/A","genres":["Ação","Comédia"],"trailer":"N/A"},
