"9266":{"id":"9266","name":"A Onda dos Sonhos","slug":"a-onda-dos-sonhos","original_title":"Blue Crush","overview":"Nada consegue ficar entre Anne Marie (Kate Bosworth) e sua prancha de surf. Apaixonada pelo esporte, ela vive próximo à praia e divide um apartamento com outras três colegas, incluindo sua irmã mais nova rebelde. Anne Marie todo dia acorda cedo para surfar e conta os dias para a chegada do Pipe Masters, o campeonato de surf que pretende participar. Enquanto isto não ocorre ele continua trabalhando em um hotel como camareira, na intenção de pagar suas contas. É lá que ela conhece o quaterback Matt Tolman (Matthew Davis), por quem aos poucos se apaixona e começa a perder a concentração pelo surf.","first_air_date":"2002-08-08","runtime":104,"episode_run_time":[104],"vote_average":6.0,"created_by":["Shutt/Jones Productions","Universal Pictures","Imagine Entertainment","Mikona Productions"],"production_companies":[{"name":"Shutt/Jones Productions"},{"name":"Universal Pictures"},{"name":"Imagine Entertainment"},{"name":"Mikona Productions"}],"cast":["Kate Bosworth","Matthew Davis","Michelle Rodriguez","Sanoe Lake","Mika Boorem"],"backdrop_path":"https://image.tmdb.org/t/p/original/xsVMKdSndUKid3Xm3Tudf5bcOlv.jpg","poster_path":"https://image.tmdb.org/t/p/original/aaYfzQWvrJ89ji1j47p2WlvxhxX.jpg","certification":"N/A","genres":["Aventura","Romance","Drama"],"trailer":"N/A"},
