"30685":{"id":"30685","name":"Renascido das Trevas","slug":"renascido-das-trevas","original_title":"Blood Creek","overview":"Em 1936, os Wollners, uma família de imigrantes alemães que vive em Town Creek - uma cidade do interior dos Estados Unidos-, é contratada pelo Terceiro Reich para serem anfitriões do professor Richard Wirth. A família, precisando de dinheiro, aceita receber o homem em sua casa. O que não sabiam é que tornariam parte de um experimento do qual seriam exilados do resto do mundo e se converteriam em participantes de um jogo de sobrevivência. Agora, em 2007, o filho mais velho, Victor, depois de escapar de seus captores, voltará a Town Creek acompanhado de seu irmão para realizar sua vingança.","first_air_date":"2009-10-09","runtime":90,"episode_run_time":[90],"vote_average":5.4,"created_by":["Gold Circle Films"],"production_companies":[{"name":"Gold Circle Films"}],"cast":["Dominic Purcell","Henry Cavill","Michael Fassbender","Emma Booth","Rainer Winkelvoss"],"backdrop_path":"https://image.tmdb.org/t/p/original/rsdAVdaFjF2cUgsd9ctEjula0c8.jpg","poster_path":"https://image.tmdb.org/t/p/original/i0nwhlyHPxz5THV3muyjZEiCFFC.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
