"192149":{"id":"192149","name":"As Duas Faces de Janeiro","slug":"as-duas-faces-de-janeiro","original_title":"The Two Faces of January","overview":"Nos anos 1960, o jovem casal Chester e Colette decide fazer uma viagem de barco à Grécia. No local, eles conhecem Rydal, um guia americano que fala grego e decide ajudá-los no passeio. O que eles não sabem é que Rydal é conhecido por aplicar golpes nos turistas... Mas Chester e Colette também têm os seus segredos, e certa noite, quando o guia decide visitá-los em seu quarto de hotel, descobre o cadáver de um homem que Chester afirma tê-lo atacado. Sem saber como sair da situação, Rydal ajuda a remover o corpo. Logo, o trio acaba envolvido em um crime do qual não pode mais fugir.","first_air_date":"2014-05-16","runtime":96,"episode_run_time":[96],"vote_average":5.8,"created_by":["StudioCanal","Working Title Films","Timnick Films","Mirage Enterprises","Anton Capital Entertainment"],"production_companies":[{"name":"StudioCanal"},{"name":"Working Title Films"},{"name":"Timnick Films"},{"name":"Mirage Enterprises"},{"name":"Anton Capital Entertainment"}],"cast":["Viggo Mortensen","Kirsten Dunst","Oscar Isaac","Yiğit Özşener","Daisy Bevan"],"backdrop_path":"https://image.tmdb.org/t/p/original/A0wn8YXBRwO3IAOb31Ki3Twtrqb.jpg","poster_path":"https://image.tmdb.org/t/p/original/811VT3qPro5tX8Fv7qYCqzqIqrr.jpg","certification":"12","genres":["Thriller"],"trailer":"N/A"},
