"265228":{"id":"265228","name":"Timbuktu","slug":"timbuktu","original_title":"Timbuktu","overview":"Em 2012, em Timbuktu no Mali, o pastor de gado Kidane vive pacificamente nas dunas com sua esposa Satima, sua filha Toya e seu filho Issan de doze anos. Na cidade, as pessoas sofrem impotentes, com o regime de terror imposto pelos jihadistas determinados a controlar sua fé. Música, risos, cigarros, mesmo o futebol, foram proibidos. As mulheres tornaram-se sombrias, mas resistem com dignidade. Todos os dias, os novos tribunais improvisados emitem sentenças trágicas e absurdas. Kidane e sua família, por morarem nas dunas, estão sendo poupados do caos que reina em Timbuktu. Mas seu destino mudará abruptamente.","first_air_date":"2014-12-10","runtime":97,"episode_run_time":[97],"vote_average":7.0,"created_by":["Les films du Worso","Orange Studio","Arches Films","ARTE France Cinéma","Dune Vision"],"production_companies":[{"name":"Les films du Worso"},{"name":"Orange Studio"},{"name":"Arches Films"},{"name":"ARTE France Cinéma"},{"name":"Dune Vision"}],"cast":["Ibrahim Ahmed","Toulou Kiki","Layla Walet Mohamed","Abel Jafri","Kettly Noël"],"backdrop_path":"https://image.tmdb.org/t/p/original/3cQO2X0vRpMYwNhoZURSCxUpCPh.jpg","poster_path":"https://image.tmdb.org/t/p/original/pG5SYVCdN22Cc10nKhW4XFugtpj.jpg","certification":"14 anos","genres":["Drama","Guerra"],"trailer":"N/A"},
