"26177":{"id":"26177","name":"Annie","slug":"annie","original_title":"Annie","overview":"Adaptação feita para a TV de um musical da Broadway, filmado anteriormente em 1982 por John Huston, e baseado em quadrinhos de Harold Gray - com pequena participação da atriz Andrea McArdle, que interpretou Annie na Broadway. O centro das atenções é a órfã Annie, que vive em um orfanato comandado pela terrível Senhorita Hannigan. Annie não gosta do lugar e odeia a Senhorita Hannigan, assim, quando o famoso e excêntrico bilionário Oliver; Warbucks escolhe Annie para passar o Natal na mansão dele, ela comemora. O charmoso Warbucks pretende adotar Annie, mas ela reluta, por acreditar que seus pais um dia irão voltar. Querendo agradá-la, o bilionário oferece uma recompensa para quem encontrar os verdadeiros pais de Annie e a Senhorita Hannigan, vendo a possibilidade de ganhar dinheiro fácil, arma um esquema para que seu irmão Rooster e sua namorada Lily passem-se pelos pais perdidos de Annie.","first_air_date":"1999-11-07","runtime":90,"episode_run_time":[90],"vote_average":6.4,"created_by":["Storyline Entertainment","Columbia TriStar Television","Chris Montan Productions","Walt Disney Television"],"production_companies":[{"name":"Storyline Entertainment"},{"name":"Columbia TriStar Television"},{"name":"Chris Montan Productions"},{"name":"Walt Disney Television"}],"cast":["Alicia Morton","Kathy Bates","Victor Garber","Alan Cumming","Audra McDonald"],"backdrop_path":"https://image.tmdb.org/t/p/original/xXbEXEYJrEcMJ4RKbTeLtrlCMl.jpg","poster_path":"https://image.tmdb.org/t/p/original/y0XWZC1A7PbWf1gwmvbvhY9uWM2.jpg","certification":"N/A","genres":["Música","Família","Comédia"],"trailer":"N/A"},
