"11718":{"id":"11718","name":"Quem é Harry Crumb?","slug":"quem-e-harry-crumb","original_title":"Who's Harry Crumb?","overview":"Quando Jennifer Downing (Renée Coleman), a filha do magnata P.J. Downing (Barry Corbin), é sequestrada, o pai está disposto em fazer tudo para ter sua filha de volta. Um amigo, Eliot Draisen (Jeffrey Jones), diz que a única pessoa que poderá ajudá-lo é Harry Crumb (John Candy), o último descendente de uma família de grandes detetives. Acontece que Harry é um profissional decadente, que sempre faz muitas trapalhadas ao tentar resolver os casos. Desta vez talvez as coisas sejam um pouco diferentes, pois Nikki Downing (Shawnee Smith), a irmã de Jennifer, quer ajudá-lo nas investigações.","first_air_date":"1989-02-03","runtime":94,"episode_run_time":[94],"vote_average":5.9,"created_by":["Frostbacks","TriStar Pictures","NBC Productions","Arnon Milchan Productions"],"production_companies":[{"name":"Frostbacks"},{"name":"TriStar Pictures"},{"name":"NBC Productions"},{"name":"Arnon Milchan Productions"}],"cast":["John Candy","Jeffrey Jones","Annie Potts","Tim Thomerson","Barry Corbin"],"backdrop_path":"https://image.tmdb.org/t/p/original/hNQ0R4wSaXTUPUQti8FtKLf1HQ6.jpg","poster_path":"https://image.tmdb.org/t/p/original/icN2yhQYFrP9Q5hvnaxlNJDjNHR.jpg","certification":"N/A","genres":["Comédia","Crime","Mistério"],"trailer":"N/A"},
