"214314":{"id":"214314","name":"Ursos","slug":"ursos","original_title":"Bears","overview":"Apresentando um ano na vida de uma família de ursos, onde a mãe ensina seus dois impressionáveis filhotes as lições mais importantes da vida. Situado em um cenário majestoso do Alasca, sua jornada começa quando o inverno termina. Emergindo da hibernação, os três enfrentam o emocionante e muito arriscado mundo exterior. Surpreendente captura de imagens de uma família carinhosa aprendendo a viver a vida ao máximo, em uma das últimas grandes regiões selvagens do planeta. (e Livre - Estimado Livre)","first_air_date":"2014-04-17","runtime":78,"episode_run_time":[78],"vote_average":7.4,"created_by":["Disneynature"],"production_companies":[{"name":"Disneynature"}],"cast":["John C. Reilly"],"backdrop_path":"https://image.tmdb.org/t/p/original/8dqdWKHbrFTQj0ttq6AdwWkUYeU.jpg","poster_path":"https://image.tmdb.org/t/p/original/9Uh2r3hf8Lfl0R2bHLbbuN3D2tZ.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
"118612":{"id":"118612","name":"After","slug":"after","original_title":"After","overview":"O roteiro gira em torno de dois sobreviventes de um acidente de ônibus, que ao recuperar a consciência ainda no hospital percebem que são os únicos sobreviventes do acidente. Enquanto uma negra névoa se aproxima de sua cidade, eles formam uma improvável aliança para desvendar a verdade sobre o isolamento no qual se encontram, e também para tentar escapar das vorazes criaturas que se formam dentro da névoa.","first_air_date":"2012-08-27","runtime":90,"episode_run_time":[90],"vote_average":5.5,"created_by":["Quite Quick Productions","Seabourne Pictures"],"production_companies":[{"name":"Quite Quick Productions"},{"name":"Seabourne Pictures"}],"cast":["Steven Strait","Karolina Wydra","Sandra Ellis Lafferty","Ric Reitz","Jackson Walker"],"backdrop_path":"https://image.tmdb.org/t/p/original/EJIstDMBj70my4IZVMX7uJlJ85.jpg","poster_path":"https://image.tmdb.org/t/p/original/5AKcsJYztbcX2KsyCXtKucyUUMA.jpg","certification":"N/A","genres":["Mistério","Thriller"],"trailer":"N/A"},
"9967":{"id":"9967","name":"De Volta para o Inferno","slug":"de-volta-para-o-inferno","original_title":"Uncommon Valor","overview":"Cal Rhodes é um coronel aposentado do exército norte-americano que tem tentado durante dez anos conseguir do governo alguma informação relativa ao desaparecimento de Frank, seu filho, que em 1972 tinha sido considerado desaparecido na Guerra do Vietnã. Frank foi visto pela última em um campo de prisioneiros de guerra no Laos, mas apesar desta informação o governo nada faz, pois considera Frank desaparecido em combate. Assim Cal usa toda sua experiência militar para formar um grupo de resgate formado por veteranos e um novato, Scott, cujo pai também foi para o Vietnã e não voltou, e treiná-lo. Cal tem total apoio financeiro de MacGregor, um multimilionário cujo filho também é um prisioneiro de guerra. Mas esta missão envolve riscos e provavelmente nem todos vão sobreviver.","first_air_date":"1983-12-16","runtime":105,"episode_run_time":[105],"vote_average":6.2,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Gene Hackman","Fred Ward","Robert Stack","Patrick Swayze","Harold Sylvester"],"backdrop_path":"https://image.tmdb.org/t/p/original/9f59numwLjCBxGpYDspN8OtO4tM.jpg","poster_path":"https://image.tmdb.org/t/p/original/lkb6pgb1SQCKy99xVP2oTPXFfeC.jpg","certification":"N/A","genres":["Drama","Guerra","Ação"],"trailer":"N/A"},
