"27936":{"id":"27936","name":"MicMacs - Um Plano Complicado","slug":"micmacs-um-plano-complicado","original_title":"Micmacs à tire-larigot","overview":"O filme centra-se em Bazil (Danny Boon), que vê a sua vida virar do avesso ao ser atingido por um tiro na cabeça. Quando sai do hospital, sem dinheiro e sem casa, acaba por ser acolhido por um excêntrico bando de ex-condenados, que preparam uma vingança contra os fabricantes de armas.","first_air_date":"2009-10-28","runtime":104,"episode_run_time":[104],"vote_average":6.6,"created_by":["Epithète Films","Tapioca Films","Warner Bros. Entertainment France","France 2 Cinéma","France 3 Cinéma","OCS","France 2","France 3","La Région Île-de-France"],"production_companies":[{"name":"Epithète Films"},{"name":"Tapioca Films"},{"name":"Warner Bros. Entertainment France"},{"name":"France 2 Cinéma"},{"name":"France 3 Cinéma"},{"name":"OCS"},{"name":"France 2"},{"name":"France 3"},{"name":"La Région Île-de-France"}],"cast":["Dany Boon","Dominique Pinon","André Dussollier","Jean-Pierre Marielle","Julie Ferrier"],"backdrop_path":"https://image.tmdb.org/t/p/original/v4qLFzxjksTadTo2R13s8B0s2Y7.jpg","poster_path":"https://image.tmdb.org/t/p/original/aRSEs2Wkb8b0BpoKfu488vi0t9B.jpg","certification":"N/A","genres":["Ação","Comédia","Crime"],"trailer":"N/A"},
"13644":{"id":"13644","name":"Um Pedido De Natal","slug":"um-pedido-de-natal","original_title":"All I Want For Christmas","overview":"Os irmãos Ethan e Hallie O'Fallon gostariam que a mãe divorciada voltasse para o pai, Michael. Na véspera do Natal, eles trancam o namorado da mãe em um caminhão de sorvetes e o despacham para Nova Jersey para que a mãe pense que ele sumiu sem avisar. O plano dá certo, pois o pai está por perto para se aproveitar da situação.","first_air_date":"1991-11-08","runtime":92,"episode_run_time":[92],"vote_average":5.6,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Harley Jane Kozak","Jamey Sheridan","Thora Birch","Ethan Embry","Kevin Nealon"],"backdrop_path":"https://image.tmdb.org/t/p/original/nJ0O5fqDzLPz1rPo0s5e0BDfBBY.jpg","poster_path":"https://image.tmdb.org/t/p/original/4g7YcglgmE1h5AI5IVZrPou5Vu4.jpg","certification":"N/A","genres":["Família","Drama","Comédia"],"trailer":"N/A"},
"14134":{"id":"14134","name":"Estou aqui para você","slug":"estou-aqui-para-voce","original_title":"मैं हूँ ना","overview":"Main Hoon Na conta a história do oficial do exército Ram Prasad Sharma (Shahrukh Khan) e seus esforços para frustrar o terrorista Raghavan Datta (Sunil Shetty), que não quer permitir que ocorra um acordo que representa um primeiro passo para a paz entre Índia e Paquistão. Ao mesmo tempo,Ram se depara com a missão de tentar melhorar o relacionamento com a ex-mulher de seu pai (Kirron Kher) e seu meio-irmão Lucky(Zayed Khan). Ambos foram embora de casa quando Ram era criança e Lucky apenas um bebê, pois sua madrasta não aceitou receber Ram em sua casa - ele era fruto de um relacionamento extra-conjugal de seu marido e foi morar com a família ao perder a mãe. Ram não conta aos dois sobre sua verdadeira identidade e vai estudar na mesma universidade de Lucky para tentar conquistar o amor de ambos e proteger além deles, Sanjana(Amrita Rao), a rebelde filha de seu superior que está sendo ameaçada por Raghavan.","first_air_date":"2004-04-30","runtime":179,"episode_run_time":[179],"vote_average":6.7,"created_by":["Red Chillies Entertainment","Venus Films"],"production_companies":[{"name":"Red Chillies Entertainment"},{"name":"Venus Films"}],"cast":["शाहरुख़ ख़ान","Sushmita Sen","Suniel Shetty","Zayed Khan","Amrita Rao"],"backdrop_path":"https://image.tmdb.org/t/p/original/v9WuP3V5eeJudaqoDE870HEuYSk.jpg","poster_path":"https://image.tmdb.org/t/p/original/iiZ8BgmAsxKUEyO6ux8z6GHiE6j.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
