"9449":{"id":"9449","name":"Os Pequeninos","slug":"os-pequeninos","original_title":"The Borrowers","overview":"A família Clock de 15 cm divide secretamente uma casa com a família Lender de tamanho normal, \"emprestando\" itens como fios, alfinetes de segurança, baterias e restos de comida. No entanto, sua coexistência pacífica é perturbada quando o advogado do mal Ocious P. Potter rouba o testamento que concede o título à casa, que ele planeja demolir para construir apartamentos. Os credores são forçados a se mudar, e os relógios correm o risco de serem expostos ao mundo de tamanho normal.","first_air_date":"1997-12-05","runtime":83,"episode_run_time":[83],"vote_average":6.0,"created_by":["Working Title Films","PolyGram Filmed Entertainment"],"production_companies":[{"name":"Working Title Films"},{"name":"PolyGram Filmed Entertainment"}],"cast":["John Goodman","Mark Williams","Jim Broadbent","Celia Imrie","Flora Newbigin"],"backdrop_path":"https://image.tmdb.org/t/p/original/8lINDPYxDBKIedM7ZGsTytmZ0ga.jpg","poster_path":"https://image.tmdb.org/t/p/original/gWebyRvPFChtDBk14QJ7HFv4APo.jpg","certification":"N/A","genres":["Aventura","Fantasia","Ação","Comédia","Família"],"trailer":"N/A"},
